INSERT INTO `help` VALUES (1,'<p><!-- \n	- Bilder in voller Breite sind width:765px; / height:545px; margin-left:5px;\n	- \n	--> <strong>ToDo-Liste:</strong> <br />Das erste was man sieht, wenn man sich auf vitoop einloggt, ist die ToDo-Liste. Die hat zwar nicht viel mit der Datenbank zu tun, kann aber ganz praktisch sein, um eingene Info-Schnipsel zu speichern. Rechts oben kann man eine &Uuml;berschrift f&uuml;r einen ToDo-Punkt eintragen und links in der Text-Box einen Test eingeben und ihn formatieren. Bilder kann man mit Strg.+C irgentwo kopieren und mit Strg.+V einf&uuml;gen. Wichtig: Wenn man die &Auml;nderungen nicht mit dem unteren Button speichert, gehen sie verloren. <br /><br /> <img style=\"height: 545px; width: 765px; margin-left: 5px; margin-top: 3px; margin-bottom: 25px;\" src=\"https://www.vitoop.org/hilfedatei/bild_1.jpg\" alt=\"\" /> <strong>Datens&auml;tze suchen:</strong> Wenn man Datens&auml;tze zu einem bestimmten Thema suchen will, gibt man entsprechende Tags (Stichworte) in die Suchleiste oben rechts ein und klickt auf den Button ganz rechts (die Suchleiste wird nur eingeblendet, wenn man sich in einem Bereich befindet, in dem man auch was suchen kann). Wenn man nur nach einem Tag sucht wird das Suchergebnis von oben nach unten sortiert, je nachdem wie h&auml;ufig ein Tag den jeweiligen Datens&auml;tzen zugewiesen wurde. Wenn man nach mehreren Tags sucht, kann man die Tags die sich in der Suchleiste befinden mit einem Klick auf das Symbol links vom Tag justieren:</p>\n<ul>\n<li>Wenn man es blau markiert, werden Datens&auml;tze im Suchergebnis nach oben sortiert, die mit diesem Tag verkn&uuml;pft sind.</li>\n<li>Wenn man ein Tag durchstreicht, sind Datens&auml;tze, die mit diesem Tag verkn&uuml;pft sind nicht im Suchergebnis enthalten.</li>\n</ul>\n<p><br /> Im Beispiel unten wird nach Sozialstaat und Wohlfahrtsstaat gesucht, HartzIV ist durchgestrichen. Das Suchergebnis besteht aus Datens&auml;tzen, die mit den beiden ersten Tags verkn&uuml;pft sind, wobei die Datens&auml;tze mit dem Tag Sozialstaat nach oben sortieren werden. Datens&auml;tze mit HartzIV werden aussortiert. --&gt; einfach mal ausprobieren :) Eine Liste mit den Tags, die in der Datenbank vertreten sind und die Anzahl der getaggten Datens&auml;tze, kann man sehen unter dem Button Tags unten auf der Seite. <br /><br /> <img style=\"margin-left: 5px; margin-top: 3px; margin-bottom: 40px;\" src=\"https://www.vitoop.org/hilfedatei/bild_2.jpg\" alt=\"\" /> <br /> <strong>Wenn man sich einen Datensatz anschauen m&ouml;chte, klickt man entweder in der &Uuml;bersichtsliste auf den Button ganz rechts, oder im Detail-Datensatz auf den Button rechts von der URL. </strong> <br /> <br /> <br /> <strong>Detaildatensatz:</strong> <br /> Wenn man sich den Detaildatensatz anschauen will, klickt man in der Liste auf den entsprechenden Datensatz. <br />- Im Reiter <strong>Anmerkungen</strong> kann man eine Art Zusammenfassung des Datensatzes schreiben, damit sich andere Nutzer ein Bild von der Aussagekraft des Datensatzes machen k&ouml;nnen. <br />- Im Reiter <strong>p</strong> kann man sich private Notizen zu dem entsprechenden Datensatz machen. Dieser Bereich kann von anderen Nutzern nicht eingesehen werden. <br />- Im Reiter <strong>Kommentare</strong> kann man den Datensatz kommentieren. <br />- Im Reiter <strong>Verkn&uuml;pfungen</strong> kann der Datensatz mit einem Lexikon und/oder mit einem Projekt verkn&uuml;pft werden (genauere Beschreibung unten). <br /><br /> <img style=\"margin-left: 5px;\" src=\"https://www.vitoop.org/hilfedatei/bild_3.jpg\" alt=\"\" /> <strong>Taggen:</strong> <br />Damit Datens&auml;tze in den unterschiedlichen Bereichen aufgefunden werden k&ouml;nnen, m&uuml;ssen sie getaggt werden. Jeder Nutzer kann pro Datensatz 5 Tags zuweisen und 3 Tags l&ouml;schen. Um ein Tag zuzuweisen, schreibt man es in das Eingabefeld, w&auml;hlt ein bestehendes Tag aus der Dropdown-Liste aus und best&auml;tigt mit dem Plus-Button. Wenn ein Tag in das Eingabefeld geschrieben wird, das noch kein Bestandteil der allgemeinen Tag-Liste ist, kann es nach Best&auml;tigung einer R&uuml;ckfrage in die allgemeine Tag-Liste &uuml;bernommen werden. Bitte nur sinnvolle, richtig geschriebene Tags , im Singular eintragen &ndash; Ausnahmen machen hin und wider aber auch Sinn ;). Jedes Tag kann von einem Nutzer pro Datensatz nur einmal verwendet werden. Wenn ein Tag von einem anderen User f&uuml;r einen Datensatz schon verwendet wurde, kann man es anklicken, mit dem Plus-Button best&auml;tigen und erh&ouml;ht damit den Wert des entsprechenden Tags. Wenn man den Wert eines zu einem Datensatz schon zugewiesenen Tags reduzieren m&ouml;chte, klickt man das Tag an und geht anschlie&szlig;end auf den Minus-Button. <br /><br /> <img style=\"margin-left: 5px; margin-bottom: 20px;\" src=\"https://www.vitoop.org/hilfedatei/bild_5.jpg\" alt=\"\" /> <strong>Datens&auml;tze hinzuf&uuml;gen:</strong> <img style=\"float: right; margin-top: -15px;\" src=\"https://www.vitoop.org/hilfedatei/bild_4.jpg\" alt=\"\" /> Wenn der Datenbank ein neuer Datensatz hinzugef&uuml;gt werden soll, geht man in den richtigen Bereich und klickt auf den Neu-Button oben rechts. Damit die Aufteilung in Pdf, Textlink, Link usw. Sinn macht ist es notwendig, dass die folgenden Unterscheidungen eingehalten werden. <br />- Pdf: Links zu einer Seite im Pdf-Format. <br />- Textlink: Links zu einer Seite bei der man vor allem Text hat und in der Regel nicht mehr weiter klicken muss, um auf andere Inhalte zu kommen. <br />- Link: Links zu einer Homepage eines Internetauftritts oder zu einer Seite von der aus weitere weitere Inhalte aufgerufen werden k&ouml;nnen.<br />- Buch und Adresse: ist klar. <br /> <br /> <br /> <strong>Lexikon:</strong> <br /> Im Detail-Datensatz / Reiter Verkn&uuml;pfungen kann man einen Datensatz mit einem Lexikon-Thema verkn&uuml;pfen. Hierzu gibt man ein Thema in das Eingabefeld ein und bekommt eine nicht ver&auml;nderbare Auswahlliste angezeigt, aus der man ein Lexikon-Thema ausw&auml;hlen, und mit dem Plus-Button best&auml;tigen kann. <br /> <img style=\"margin-left: 5px; margin-top: 15px; margin-bottom: 15px;\" src=\"https://www.vitoop.org/hilfedatei/bild_6.jpg\" alt=\"\" /> Verkn&uuml;pfte Datens&auml;tze werden bei dem entsprechenden Lexikon-Thema angezeigt. Je h&auml;ufiger ein Datensatz mit einem Lexikon-Thema verkn&uuml;pft ist, desto weiter oben wird er in den Listen der verkn&uuml;pften Datens&auml;tze einsortiert (rot markiert). Das Reduzieren der Verkn&uuml;pfungen funktioniert genauso wie beim Taggen mit dem Minus-Button. Die Idee dabei ist, dass sich mit diesem Mechanismus die besten Informationen zu einem Thema ansammeln und &uuml;bersichtlich dargestellt werden. <br /> <img style=\"margin-left: 5px; margin-top: 15px; margin-bottom: 15px;\" src=\"https://www.vitoop.org/hilfedatei/bild_7.jpg\" alt=\"\" /> <br /> <br /> <strong>Projekt:</strong> <br /> Das Projekt funktioniert grunds&auml;tzlich wie das Lexikon, d.h. man kann unterschiedliche Datens&auml;tze einem bestimmten Bereich zuweisen. Dazu erstellt man ein Projekt (wird erstellt, wie andere Datens&auml;tze auch) und weist Datens&auml;tze zu, wie bei Lexikon, indem man auf den Detail-Datensatz geht und im Reiter Verkn&uuml;pfungen den Datensatz zuweist. Man kann zu einem Projekt nur Datens&auml;tze zuweisen, wenn man das Projekt selbst erstellt hat, oder die Berechtigung dazu bekommen hat. <br /> Ansicht eines Projekts <img style=\"margin-left: 5px; margin-top: 15px; margin-bottom: 15px;\" src=\"https://www.vitoop.org/hilfedatei/bild_8.jpg\" alt=\"\" /> Ansicht eines Projekts im Bearbeitungsmodus. Auf der linken Seite kann man den Projektinhalt darstellen, auf der rechten Seite kann man festlegen, ob alle das Projekt sehen k&ouml;nnen, oder ob es versteckt werden soll. Im zweiten Fall taucht es in der Liste aller Projekte auf, kann aber nur von Nutzern eingesehen werden, die hierf&uuml;r die Berechtigung haben. Das wird festgelegt auf der rechten Seite, hier kann man auch die Unterscheidung treffen, ob jemand nur lesen, oder das Projet auch ver&auml;ndern darf. Im unten stehenden Beispiel ist das Projekt versteckt, david, Lisa;-) und Rudie! haben lesenden zugriff und letzterer darf das Projekt auch bearbeiten. <img style=\"margin-left: 5px; margin-top: 15px; margin-bottom: 15px;\" src=\"https://www.vitoop.org/hilfedatei/bild_9.jpg\" alt=\"\" /></p>\n<p>&nbsp;</p>');
/*!40000 ALTER TABLE `help` ENABLE KEYS */;
