INSERT INTO `lexicon` VALUES (626,1078725,'http://de.wikipedia.org/wiki/Systemtheorie_(Luhmann)','<p>Die <b>Systemtheorie</b> nach Niklas Luhmann ist eine soziologische Theorie, durch die Gesellschaft als ein „umfassendes soziales System, das alle anderen sozialen Systeme in sich einschließt“ beschrieben und erklärt wird. Die Theorie ist von traditionellen Denkweisen und Ausgangspunkten abgegrenzt. Luhmann lehnt ontologische und transzendentalphilosophische Voraussetzungen und auch den Subjektbegriff ab. Er verwendet die Konzepte der Selbstreferenz, der autopoietischen Geschlossenheit und der Differenz und beschreibt, wie unter diesen Voraussetzungen Soziales entsteht und sich durch funktionale Differenzierung in verschiedene soziale Systeme abgrenzt. Die Entwicklung der soziologischen Systemtheorie als Hauptwerk Luhmanns in Monographien besteht in der Grundlegung der Begriffe und Unterscheidungen (<i>Soziale Systeme</i>, 1984), in darauf folgenden Beschreibungen verschiedener ausdifferenzierter sozialer Systeme und schließlich in der Erklärung der Gesellschaft als umfassendes soziales System (<i>Die Gesellschaft der Gesellschaft</i>, 1997).</p>\n<p></p>','2015-11-10 01:10:05'),(627,3050364,'http://de.wikipedia.org/wiki/Armut','','0000-00-00 00:00:00'),(628,4436,'http://de.wikipedia.org/wiki/Soziologie','','0000-00-00 00:00:00'),(629,1151004,'http://de.wikipedia.org/wiki/Gesellschaft_(Soziologie)','','0000-00-00 00:00:00'),(630,1535121,'http://de.wikipedia.org/wiki/Sozialstaat','<p>Ein <b>Sozialstaat</b> ist ein Staat, der in seinem Handeln soziale Sicherheit und soziale Gerechtigkeit anstrebt, um die Teilhabe aller an den gesellschaftlichen und politischen Entwicklungen zu gewährleisten. Bezeichnend ist auch die konkrete Gesamtheit staatlicher Einrichtungen, Steuerungsmaßnahmen und Normen, um das Ziel zu erreichen, Lebensrisiken und soziale Folgewirkungen abzufedern. Der Staat verpflichtet sich, in Gesetzgebung und Verwaltung für einen sozialen Ausgleich der Gesellschaft zu sorgen.</p>\n<p>Die konkrete Gestaltung des Sozialstaats erfolgt in der Sozialpolitik.</p>\n<p></p>','2015-09-26 15:32:39'),(631,2333192,'http://de.wikipedia.org/wiki/Deutscher_Gewerkschaftsbund','','0000-00-00 00:00:00'),(632,396860,'http://de.wikipedia.org/wiki/Salutogenese','<p><b>Salutogenese</b> (lat. <i><span lang=\"la\" xml:lang=\"la\">salus</span></i> ‚Gesundheit‘, ‚Wohlbefinden‘ und <i>-genese</i>, also etwa „Gesundheitsentstehung“) bezeichnet zum einen eine Fragestellung und Sichtweise für die Medizin und zum anderen ein Rahmenkonzept, das sich auf Faktoren und dynamische Wechselwirkungen bezieht, die zur Entstehung und Erhaltung von Gesundheit führen. Der israelisch-amerikanische Medizinsoziologe Aaron Antonovsky (1923–1994) prägte den Ausdruck in den 1980er Jahren als komplementären Begriff zu Pathogenese. Nach dem Salutogenese-Modell ist Gesundheit nicht als Zustand, sondern als Prozess zu verstehen.</p>\n<p></p>','2015-08-04 17:35:23'),(633,1795,'http://de.wikipedia.org/wiki/Gesundheit','','0000-00-00 00:00:00'),(634,17313,'http://de.wikipedia.org/wiki/Abhängigkeit_(Medizin)','<p><b>Abhängigkeit</b> (umgangssprachlich <b>Sucht</b>) bezeichnet in der Medizin das unabweisbare Verlangen nach einem bestimmten Erlebniszustand. Diesem Verlangen werden die Kräfte des Verstandes untergeordnet. Es beeinträchtigt die freie Entfaltung einer Persönlichkeit und zerstört die sozialen Bindungen und die sozialen Chancen eines Individuums. In den Fachgebieten Psychologie und Psychiatrie werden verschiedene Formen von Abhängigkeit beschrieben:</p>\n<ul><li>Abhängigkeitssyndrom durch psychotrope Substanzen (substanzgebundene Abhängigkeit, stoffliche Abhängigkeit),</li>\n<li>Schädlicher Gebrauch von körperlich nichtabhängigkeitserzeugenden Substanzen,</li>\n<li>Substanzungebundene Abhängigkeit (nichtstoffliche Abhängigkeit), sowie</li>\n<li>Co-Abhängigkeit, wenn Tun oder Unterlassen von Bezugspersonen die substanzgebundene Abhängigkeit einer Person stärkt.</li>\n</ul><p>In zahlreichen offiziellen und inoffiziellen Einrichtungen wird der Begriff „Sucht“ allerdings weiterhin verwendet.</p>\n<p></p>','2015-12-15 17:01:38'),(635,1167859,'http://de.wikipedia.org/wiki/Droge','','0000-00-00 00:00:00'),(636,2601998,'http://de.wikipedia.org/wiki/Inklusion_(Soziologie)','','0000-00-00 00:00:00'),(637,605570,'http://de.wikipedia.org/wiki/Exklusion','','0000-00-00 00:00:00'),(638,10155,'http://de.wikipedia.org/wiki/Tauschkreis','<p>In einem <b>Tauschkreis</b> oder <b>Tauschring</b> (auch Tauschzirkel, Zeittauschbörse, Nachbarschaftshilfeverein, LETS, Talentemarkt, Tauschnetz) werden vorrangig Dienstleistungen, gelegentlich auch Waren, ohne Einsatz gesetzlicher Zahlungsmittel zwischen den Teilnehmern getauscht.</p>\n<p></p>','2015-12-29 08:29:44'),(653,3855749,'http://de.wikipedia.org/wiki/Netzpolitik.org','','0000-00-00 00:00:00'),(660,1343379,'http://de.wikipedia.org/wiki/GEZ','','0000-00-00 00:00:00'),(661,3616,'http://de.wikipedia.org/wiki/Netzwerk','<p>Als <b>Netzwerke</b> werden Systeme bezeichnet, deren zugrundeliegende Struktur sich mathematisch als Graph modellieren lässt und die über Mechanismen zu ihrer Organisation verfügen. Der Graph besteht aus einer Menge von Elementen (Knoten), die mittels Verbindungen (Kanten) miteinander verbunden sind. Ein geschlossener Zug aus Kanten und Knoten heißt <i>Masche</i>.</p>\n<p>Dass der Großteil der Knoten zu einer oder mehreren Maschen gehört, ist das eigentliche Kennzeichen eines Netzwerks gegenüber anderen Typen von Strukturen. Die Mechanismen zur Organisation von Netzwerken beziehen sich definitorisch auf die durch die Maschen gegebenen redundanten Verbindungen im Netzwerk, welche unterschiedliche Verbindungswege zulassen.</p>\n<p>Netzwerke werden auf einer abstrakten Ebene in der Netzwerkforschung untersucht und in der Praxis in den jeweiligen Anwendungsgebieten, aus denen die konkreten Netze stammen.</p>\n<p></p>','2015-12-04 17:54:22'),(663,186763,'http://de.wikipedia.org/wiki/Gesellschaftskritik','','0000-00-00 00:00:00'),(664,51833,'http://de.wikipedia.org/wiki/Postmoderne','<p>Die <b>Postmoderne</b> (lat. <i>post</i> „hinter, nach“) ist im allgemeinen Sinn der Zustand der abendländischen Gesellschaft, Kultur und Kunst „nach“ der Moderne. Im besonderen Sinn ist sie eine politisch-wissenschaftlich-künstlerische Richtung, die sich gegen bestimmte Institutionen, Methoden, Begriffe und Grundannahmen der Moderne wendet und diese aufzulösen und zu überwinden versucht. Die Vertreter der Postmoderne kritisieren das Innovationsstreben der Moderne als lediglich habituell und automatisiert. Sie bescheinigen der Moderne ein illegitimes Vorherrschen eines totalitären Prinzips, das auf gesellschaftlicher Ebene Züge von Despotismus in sich trage und das bekämpft werden müsse. Maßgebliche Ansätze der Moderne seien eindimensional und gescheitert. Dem wird die Möglichkeit einer Vielfalt gleichberechtigt nebeneinander bestehender Perspektiven gegenübergestellt (Relativismus). Mit der Forderung nach einer prinzipiellen Offenheit von Kunst wird auch kritisch auf die Ästhetik der Moderne Bezug genommen.</p>\n<p>Die Diskussion über die zeitliche und inhaltliche Bestimmung dessen, was genau postmodern sei, wird etwa seit Anfang der 1980er Jahre geführt. Postmodernes Denken will nicht als bloße Zeitdiagnose verstanden werden, sondern als kritische Denkbewegung, die sich gegen Grundannahmen der Moderne wendet und Alternativen aufzeigt.</p>\n<p></p>','2015-08-04 17:21:44'),(665,5132479,'http://de.wikipedia.org/wiki/Staatsschuldenkrise_im_Euroraum','','0000-00-00 00:00:00'),(666,339326,'http://de.wikipedia.org/wiki/Kommunikation','','0000-00-00 00:00:00'),(667,4283678,'http://de.wikipedia.org/wiki/Peter_Kruse','','0000-00-00 00:00:00'),(668,12140,'http://de.wikipedia.org/wiki/Open_Source','','0000-00-00 00:00:00'),(669,781,'http://de.wikipedia.org/wiki/Bildung','','0000-00-00 00:00:00'),(670,10543,'http://de.wikipedia.org/wiki/George_Orwell','<p><b>George Orwell</b> (* 25. Juni 1903 in Motihari, Bihar, Britisch-Indien als <i>Eric Arthur Blair</i>; † 21. Januar 1950 in London) war ein englischer Schriftsteller, Essayist und Journalist. Durch seine Werke <i>Farm der Tiere</i> und <i>1984</i> wurde Orwell weltbekannt und zählt heute mit seinem Gesamtwerk zu den bedeutendsten Schriftstellern der englischen Literatur. Orwell benutzte zeitweise auch das weitere Pseudonym <i>H. Lewis Always</i>.</p>\n<p></p>','2015-08-04 17:32:55'),(671,171450,'http://de.wikipedia.org/wiki/Soziale_Software','','0000-00-00 00:00:00'),(672,123724,'http://de.wikipedia.org/wiki/Soziales_Netzwerk_(Internet)','<p>Ein <b>soziales Netzwerk</b> ist ein Online-Dienst, der eine Online-Community beherbergt. Benutzer können über soziale Netzwerke miteinander kommunizieren und teilweise im virtuellen Raum interagieren. Auf der technischen Grundlage eines sozialen Mediums (<i>Social Media</i>), das als Plattform zum wechselseitigen Austausch von Meinungen, Erfahrungen und Informationen eingesetzt wird, ergibt sich ein abgrenzbares soziales Netzwerk von Nutzern mit von ihnen erzeugten Inhalten.</p>\n<p>Bekannte soziale Netzwerke sind z. B. Twitter und Facebook.</p>\n<p></p>','2015-12-17 07:26:21'),(673,12787,'http://de.wikipedia.org/wiki/Erste_Hilfe','','0000-00-00 00:00:00'),(674,122932,'http://de.wikipedia.org/wiki/Soziale_Bewegung','<p>Unter einer <b>sozialen Bewegung</b>, auch <b>Bewegung</b>, wird in den Sozialwissenschaften ein kollektiver Akteur verstanden, der unterschiedliche Organisationsformen umfasst und mit unterschiedlichen Mobilisierungs- und Handlungsstrategien versucht, gesellschaftlichen Wandel zu beschleunigen, zu verhindern oder umzukehren. Die einzelnen Mitglieder solcher Bewegungen werden häufig als Aktivisten bezeichnet.</p>\n<p></p>','2015-03-03 10:01:47'),(678,133402,'http://de.wikipedia.org/wiki/Lerntheorie','','0000-00-00 00:00:00'),(679,3818,'http://de.wikipedia.org/wiki/Politik','','0000-00-00 00:00:00'),(712,5962879,'http://de.wikipedia.org/wiki/Big_Data','','0000-00-00 00:00:00'),(718,875931,'http://de.wikipedia.org/wiki/Kontopfändung','','0000-00-00 00:00:00'),(892,10108,'http://de.wikipedia.org/wiki/Europa','','0000-00-00 00:00:00'),(948,11713,'http://de.wikipedia.org/wiki/OpenSUSE','','0000-00-00 00:00:00'),(1181,4448,'http://de.wikipedia.org/wiki/System','','0000-00-00 00:00:00'),(1182,4450,'http://de.wikipedia.org/wiki/Systemtheorie','','0000-00-00 00:00:00'),(1183,1839,'http://de.wikipedia.org/wiki/Gruppentheorie','','0000-00-00 00:00:00'),(1184,2833296,'http://de.wikipedia.org/wiki/Finanzkrise_ab_2007','','0000-00-00 00:00:00'),(1187,1004566,'http://de.wikipedia.org/wiki/Drogenprävention','<p><b>Drogenprävention</b> (auch <b>Suchtprävention</b>) bezeichnet zum einen Maßnahmen zur <i>Verhinderung</i> bzw. <i>Reduzierung</i> des Konsums, zum anderen Maßnahmen, die Gesundheitsschäden <i>durch</i> den Konsum legaler (oft Alkohol, Nikotin, Koffein und einige Medikamente) und illegaler Drogen vorbeugen.</p>\n<p></p>','2015-03-20 13:37:11'),(1188,903748,'http://de.wikipedia.org/wiki/Trauma_(Psychologie)','<p>Als <i>psychologisches</i>, <i>seelisches</i> oder <i>mentales</i> <b>Trauma</b> oder <b>Psychotrauma</b> (Plural <i>Traumata</i>, <i>Traumen</i>; griechisch <i>Wunde</i>, τράυμα) wird in der Psychologie eine seelische Verletzung bezeichnet. Das Wort <b>Trauma</b> kommt aus dem Griechischen und bedeutet allgemein Verletzung, ohne dabei eine Festlegung zu treffen, wodurch diese hervorgerufen wurde. In der Medizin wird mit dem Begriff Trauma (Medizin) eine Verwundung bezeichnet, welche durch einen Unfall oder eine Gewalteinwirkung hervorgerufen wurde. Diese Verwendung ist seit dem 19. Jahrhundert belegt. Analog hierzu bezeichnet man in der Psychologie eine starke psychische Erschütterung, welche durch ein traumatisierendes Erlebnis hervorgerufen wurde, als <b>Psychotrauma</b>. Der Begriff wird nicht einheitlich verwendet und kann sowohl das auslösende Ereignis, aber auch die Symptome oder das hervorgerufene innere Leiden bezeichnen.</p>\n<p></p>','2015-03-16 09:06:10'),(1189,77861,'http://de.wikipedia.org/wiki/Persönlichkeitsstörung','','0000-00-00 00:00:00'),(1200,31560,'http://de.wikipedia.org/wiki/Neurowissenschaften','','0000-00-00 00:00:00'),(1285,4809474,'http://de.wikipedia.org/wiki/INDECT','','0000-00-00 00:00:00'),(1457,41217,'http://de.wikipedia.org/wiki/Emotion','','0000-00-00 00:00:00'),(2125,7722926,'http://de.wikipedia.org/wiki/PRISM_(Überwachungsprogramm)','','2015-08-04 17:31:24'),(2547,852604,'http://de.wikipedia.org/wiki/Türkei','','0000-00-00 00:00:00'),(2549,1172,'http://de.wikipedia.org/wiki/Demokratie','<p><b>Demokratie</b> (altgriechisch <span lang=\"grc\" xml:lang=\"grc\">δημοκρατία</span> „Herrschaft des Staatsvolkes“, von <span lang=\"grc\" xml:lang=\"grc\">δῆμος</span> <i>dēmos</i> ‚Staatsvolk‘ und -kratie: <span lang=\"grc\" xml:lang=\"grc\">κρατία</span> <i>kratía</i> ‚Herrschaft‘) bezeichnet Herrschaftsformen, politische Ordnungen oder politische Systeme, in denen Macht und Regierung vom Volk ausgehen, indem dieses – entweder unmittelbar oder durch Auswahl entscheidungstragender Repräsentanten – an allen Entscheidungen, die die Allgemeinheit verbindlich betreffen, beteiligt ist. In demokratischen Staaten und politischen Systemen geht die Regierung durch politische Wahlen aus dem Volk hervor. Typische Merkmale einer Demokratie sind freie Wahlen, das Mehrheitsprinzip, die Akzeptanz einer politischen Opposition, Verfassungsmäßigkeit, Schutz der Grundrechte, Schutz der Bürgerrechte und Achtung der Menschenrechte. Da die Herrschaft durch die Allgemeinheit ausgeübt wird, sind Meinungs- und Pressefreiheit zur politischen Willensbildung unerlässlich.</p>\n<p>„Demokratie“ ist in den meisten demokratischen Ländern formell ein tragendes Verfassungsprinzip, so in Deutschland (Art. 20 Abs. 1 GG), Österreich (Artikel 1 B-VG) und der Schweiz (Präambel der schweizerischen Bundesverfassung). Dies ist auch in vielen Staaten der Fall, deren demokratischer Charakter umstritten ist, wie beispielsweise im vorrevolutionären Libyen durch <i>das Grüne Buch</i> (dort: „Die Lösung des Demokratie-Problems“, 1975).</p>\n<p>Moderne Monarchien sind mit dem Demokratiebegriff in vielerlei Hinsicht vereinbar geworden – so haben sich Staatsformen wie die parlamentarische Monarchie herausgebildet, die entscheidende Elemente einer Demokratie in sich vereinen. Viele der existierenden Demokratien sind außerdem Republiken.</p>\n<p></p>','2015-12-29 14:35:50'),(3219,287363,'http://de.wikipedia.org/wiki/Überwachungsstaat','<p>In einem <b>Überwachungsstaat</b> (selten auch Big-Brother-Staat) überwacht der Staat seine Bürger in großem Stil mit einer Vielzahl verschiedener, staatlich legalisierter technischer Mittel. Der Begriff ist negativ besetzt und beinhaltet sinngemäß, dass die Überwachung ein solches Ausmaß angenommen hat, dass sie ein wesentliches oder sogar zentrales Merkmal des staatlichen Handelns geworden ist. Kritiker solcher Maßnahmen führen an, dass die massenhafte Überwachung der Bevölkerung eine Vielzahl von Gefahren für demokratische Gesellschaften berge.</p>\n<p>Als häufig zitiertes Negativ-Beispiel und als Symbol eines zur Diktatur ausgearteten Überwachungsstaats gilt der Roman <i>1984</i> des britischen Schriftstellers George Orwell, der auch den Begriff <i><span lang=\"en\" xml:lang=\"en\">Big Brother</span></i> (engl. f. Großer Bruder) prägte. Bedenken gegen die zunehmende staatliche Überwachung führten bereits seit den Terroranschlägen vom 11. September 2001 verstärkt zu öffentlichen Debatten, in Deutschland etwa unter dem Schlagwort Stasi 2.0, und zu Protesten wie den <i>Freiheit-statt-Angst</i>-Demonstrationen. Seit den Enthüllungen zur umfassenden Internet- und Telekommunikationsüberwachung durch die USA und das Vereinigte Königreich im Rahmen der globalen Überwachungs- und Spionageaffäre ist die Thematik seit Mitte 2013 wieder verstärkt Gegenstand öffentlicher und medialer Debatten.</p>\n<p></p>','2015-08-04 17:30:29'),(3220,28318,'http://de.wikipedia.org/wiki/Videoüberwachung','','0000-00-00 00:00:00'),(3221,10776,'http://de.wikipedia.org/wiki/Überwachung','<p><b>Überwachung</b> ist die zielgerichtete Beobachtung und Informationserhebung von Objekten, Personen oder Gegenständen durch am Geschehen unbeteiligte Dritte. Auf die Überwachung von Personen gerichtet, spricht man auch von <b>Observierung</b> oder <b>Observation</b>, bei Naturphänomenen von <b>Monitoring</b>.</p>\n<p>Der Begriff <i>Überwachung</i> ist an sich neutral und betrifft viele unterschiedliche Anwendungsbereiche, z. B. Sicherung von Objekten, Videokameras im Verkehr, Prävention von Gewalttaten oder Schutz vor Naturkatastrophen. Doch hat das Wort im Deutschen durch die zunehmende öffentliche Thematisierung der Überwachung von Bürgern durch staatliche Institutionen eine negative Besetzung erhalten – <i>siehe auch: Überwachungsstaat</i>.</p>\n<p></p>','2015-12-03 19:05:54'),(3222,1337347,'http://de.wikipedia.org/wiki/Google','<p><b>Google</b> ist eine Suchmaschine des US-amerikanischen Unternehmens Google Inc. Übereinstimmende Statistiken zeigen bei weltweiten Suchanfragen Google als Marktführer unter den Internet-Suchmaschinen. Der Vorläufer <i>BackRub</i> begann mit dem Echtbetrieb im Jahr 1996, seit 27. September 1998 ist die Suchmaschine unter dem Namen <i>Google</i> online. Seitdem hat sich ihre Oberfläche nur geringfügig verändert. Durch den Erfolg der Suchmaschine in Kombination mit kontextsensitiver Werbung aus dem AdSense-Programm konnte das Unternehmen Google Inc. eine Reihe weiterer Software-Lösungen finanzieren, die über die Google-Seite zu erreichen sind. Die Suche ist allerdings nach wie vor das Kern-Geschäftsfeld von Google. Zeitweise verwendete der Konkurrent Yahoo gegen Bezahlung die Datenbanken von Google für die eigene Suche.</p>\n\n<p></p>','2015-07-20 19:17:49'),(3223,427757,'http://de.wikipedia.org/wiki/Instituto_Nacional_de_Estadística_y_Censos','','0000-00-00 00:00:00'),(3224,141784,'http://de.wikipedia.org/wiki/Smartphone','<p>Ein <b>Smartphone</b> ([<span><span title=\"Aussprache im Internationalen Phonetischen Alphabet (IPA)\">ˈsmaːɐ̯tfoʊ̯n</span></span>]; [<span><span title=\"Aussprache im Internationalen Phonetischen Alphabet (IPA)\">ˈsmɑɹtfoʊ̯n</span></span>] <sup><i>AE</i></sup>, [<span><span title=\"Aussprache im Internationalen Phonetischen Alphabet (IPA)\">ˈsmɑːtˌfəʊ̯n</span></span>] <sup><i>BE</i></sup>) ist ein Mobiltelefon (umgangssprachlich <i>Handy</i>), das zahlreiche Computer-Funktionalitäten und -<i>konnektivität</i> als ein „reines“ Mobiltelefon zur Verfügung stellt. Erste Smartphones vereinigten die Funktionen eines Personal Digital Assistant (PDA) bzw. Tabletcomputers mit der Funktionalität eines Mobiltelefons. Später wurde dem kompakten Gerät auch noch die Funktion eines transportablen Medienabspielgerätes, einer Digital- und Videokamera und eines GPS-Navigationsgeräts hinzugefügt.</p>\n<p>Ein zentrales Merkmal moderner Smartphones sind berührungsempfindliche Bildschirme. Darüber können sowohl Standard-Webseiten als auch mobil optimierte Webseiten dargestellt werden. Eine schnelle Internet-Anbindung erfolgt wahlweise mittels einer mobilen Breitbandverbindung über den Mobilfunkanbieter oder per WLAN. Ein wichtiges Merkmal ist auch, dass der Nutzer über ein Internet-Downloadportal (einen „App Store“) auf einfache Weise Zusatzprogramme („Apps“) installieren kann, die es mittlerweile für eine große Vielfalt von Anwendungszwecken gibt. Ein Smartphone kann prinzipiell über seine Gebrauchsdauer per Software- und Betriebssystem-Update der technischen Entwicklung folgen, jedoch stellen die meisten Hersteller die Unterstützung älterer Modelle nach wenigen Jahren weitgehend ein.</p>\n<p>Die ersten Smartphones gab es bereits in den 1990er Jahren, aber erst mit der Einführung des Apple iPhone im Jahr 2007 gewannen sie nennenswerte Marktanteile. Heute sind die meisten verkauften Mobiltelefone Smartphones. Durch den permanent mitgeführten Internetzugang löste dies einen Wandel im Internet-Nutzungsverhalten aus, insbesondere bei sozialen Netzwerken wie Facebook oder Twitter. Online-Enzyklopädien wie die Wikipedia profitieren ebenso durch die permanente Verfügbarkeit, da Artikel auch von unterwegs bearbeitet und Fotos deutlich einfacher hochgeladen werden können. Das meistverbreitete Smartphone-Betriebssystem ist das von fast allen Herstellern verwendete Android (Marktanteil Mitte 2014 etwa 85 %), mit einigem Abstand gefolgt von dem nur auf Apple-Geräten eingesetzten Apple iOS (Marktanteil Mitte 2014 etwa 12 %).</p>\n<p></p>\n','2015-07-20 19:17:26'),(3225,39783,'http://de.wikipedia.org/wiki/Telekommunikation','<p>Als <b>Telekommunikation</b> (altgriechisch <span lang=\"grc\" xml:lang=\"grc\">τηλέ</span> ,fern‘ und lateinisch <span lang=\"la\" xml:lang=\"la\"><i>communicare</i></span> ‚gemeinsam machen‘, ‚mitteilen‘) oder <b>Fernmeldewesen</b> wird jeglicher Austausch von Informationen über eine räumliche Distanz hinweg bezeichnet.</p>\n<p>Die Signalübertragung kann entweder als Optische Telegrafie (Rauch- oder Feuerzeichen, Flaggenzeichen, Spiegeltelegraphen oder Infrarot), als Schallzeichen (Nebelhorn, Sirene oder Jagdhorn), kabelgebunden (Elektrischer Telegraf, Telefon, Fernschreiber) oder drahtlos (Funktelegrafie, Sprechfunk, Rundfunk) erfolgen. In der heutigen Nachrichtentechnik erfolgt Telekommunikation fast ausschließlich über Kabel (Fernmeldekabel, Koaxialkabel, auch über das Stromnetz) oder mittels Funktechnik drahtlos. Die optische und akustische Signalübertragung wurde bereits im Altertum und früher verwendet.</p>\n<p></p>','2015-02-25 16:59:56'),(3226,23114,'http://de.wikipedia.org/wiki/NSA','','0000-00-00 00:00:00'),(3227,28317,'http://de.wikipedia.org/wiki/Datenschutz','<p><b>Datenschutz</b> ist ein in der zweiten Hälfte des 20. Jahrhunderts entstandener Begriff, der nicht einheitlich definiert und interpretiert wird. Je nach Betrachtungsweise wird Datenschutz verstanden als Schutz vor missbräuchlicher Datenverarbeitung, Schutz des Rechts auf informationelle Selbstbestimmung, Schutz des Persönlichkeitsrechts bei der Datenverarbeitung oder Schutz der Privatsphäre. Datenschutz steht für die Idee, dass jeder Mensch grundsätzlich selbst entscheiden kann, wem wann welche seiner persönlichen Daten zugänglich sein sollen. Der Datenschutz soll der in der zunehmend computerisierten und vernetzten Informationsgesellschaft bestehenden Tendenz zum so genannten gläsernen Menschen und dem Ausufern staatlicher Überwachungsmaßnahmen (Überwachungsstaat) und nichtstaatlicher Datenmonopole entgegenwirken.</p>\n<p></p>','2015-07-26 16:06:47'),(3249,120637,'http://de.wikipedia.org/wiki/Soziale_Arbeit','<p><b>Soziale Arbeit</b> ist die Bezeichnung einer angewandten Wissenschaft, die seit den 1990er Jahren als Ober- und Sammelbegriff der traditionellen Fachrichtungen <b>Sozialpädagogik</b> und <b>Sozialarbeit</b> gebraucht wird. <i>Soziale Arbeit</i> ist zugleich die Bezeichnung der entsprechenden Berufsgruppe wie auch der wissenschaftlichen Disziplin.</p>\n<p></p>','2015-06-22 20:16:12'),(3261,12061,'http://de.wikipedia.org/wiki/Depression','<p>Die <b>Depression</b> (von lateinisch <span lang=\"la\" xml:lang=\"la\"><i>deprimere</i></span> „niederdrücken“) ist eine psychische Störung mit Zuständen psychischer Niedergeschlagenheit als Leitsymptom. In der Psychiatrie wird die Depression den affektiven Störungen zugeordnet. Im gegenwärtig verwendeten Klassifikationssystem psychischer und anderer Erkrankungen (ICD 10) bezeichnet man die häufigsten Formen der Depression als <i>depressive Episode</i> oder <i>rezidivierende (wiederkehrende) depressive Störung</i>. Die Diagnose wird nach Symptomen und Verlauf gestellt.</p>\n<p>Zur Behandlung <i>depressiver Störungen</i> werden nach Aufklärung über die Ursachen und den Verlauf der Erkrankung entweder Antidepressiva eingesetzt oder (je nach Schweregrad) auch eine Psychotherapie ohne Medikation (beispielsweise kognitive verhaltenstherapeutische oder tiefenpsychologische Verfahren). Im alltäglichen Sprachgebrauch wird der Begriff <i>depressiv</i> häufig – beispielsweise für eine Verstimmung – verwendet; gleichwohl ist die Depression im psychiatrischen Sinne eine ernste behandlungsbedürftige Störung, deren Symptome sich der Beeinflussung durch reine Willenskraft entziehen.</p>\n<p></p>','2015-07-20 19:17:06'),(3312,3110701,'http://de.wikipedia.org/wiki/Globalisierung','<p>Der Begriff <b>Globalisierung</b> bezeichnet den Vorgang, dass internationale Verflechtungen in vielen Bereichen (Wirtschaft, Politik, Kultur, Umwelt, Kommunikation) zunehmen, und zwar zwischen Individuen, Gesellschaften, Institutionen und Staaten.</p>\n<p>Der Begriff entstand wohl in den 1960er Jahren. Ab etwa 1986 erschienen zahlreiche deutschsprachige Bücher, die <i>Globalisierung</i> im Buchtitel verwendeten.</p>\n<p>Als wesentliche Ursachen der Globalisierung gelten</p>\n<ul><li>technische Fortschritte (siehe auch: Digitale Revolution), insbesondere in Kommunikations- und Transporttechnologien,</li>\n<li>politische Entscheidungen und Maßnahmen zur Liberalisierung des Welthandels</li>\n<li>das Bevölkerungswachstum in vielen Ländern</li>\n<li>die Containerisierung des Stückguttransports (sie ermöglichte es, Transport, Umschlag und Zwischenlagerung effizienter zu machen).</li>\n</ul><p>Als Vorläufer der Globalisierung gilt der Kolonialismus vieler europäischer Staaten. Er begann mit der Entdeckung neuer Seewege und Länder. Hauptakteure waren jahrhundertelang Portugal und Spanien. England wurde bald nach Napoleons Ende die führende Seemacht der Welt (British Empire). Von etwa 1880 bis 1914 versuchten viele europäische Länder, Kolonien unter ihren Einfluss zu bringen bzw. zu halten (Hochphase des Imperialismus). Japan versuchte dies bis 1945 (Näheres hier).</p>\n<p>Nach dem Zweiten Weltkrieg begann die Dekolonisation. Im „Afrikanischen Jahr“ 1960 erlangten 18 afrikanische Staaten die Unabhängigkeit. Die Ex-Kolonien können seitdem Handelsbeziehungen zu anderen Ländern haben. Der Fall des Eisernen Vorhangs und das Ende des Kalten Krieges hat die geopolitische Lage deutlich verändert und dies hat die Globalisierung beeinflusst.</p>\n<p></p>','2015-07-16 08:02:05'),(3346,53278,'http://de.wikipedia.org/wiki/Finanzmarkt','<p><b>Finanzmarkt</b> ist ein Oberbegriff für alle Märkte, auf denen ein Handel mit Kapital stattfindet. Der Unterschied zum Gütermarkt liegt vor allem in der Zukunftsbezogenheit der erworbenen Rechtsansprüche und darin, dass ausschließlich Geldzahlungen – allenfalls ergänzt durch weitere Rechtsansprüche – getauscht werden. Der Finanzmarkt gliedert sich einerseits in nationale und internationale Finanzmärkte und andererseits, abhängig vom Gegenstand der gehandelten Finanzmittel, in</p>\n<ul><li>Geldmarkt,</li>\n<li>Kredit- und Kapitalmärkte und den</li>\n<li>Devisenmarkt.</li>\n</ul><p>Diese Aufgliederung wird vorgenommen, da auf den verschiedenen Teilmärkten diverse Teilnehmer sowie Marktgegebenheiten vorhanden sind. Finanzmärkte sind somit Märkte, auf denen Kapital in Form von Wertpapieren, unverbrieften Rechten, Zentralbankgeld sowie Darlehens- und Kreditverträgen gehandelt wird. Ein Anbieter hat auf dem Finanzmarkt die Möglichkeit, sein Geld bzw. Vermögen gewinnbringend anzulegen. Der Nachfrager ermöglicht sich durch den Handel am Finanzmarkt die Finanzierung von Investitionen. Finanzmärkte bringen Kapitalanleger und Kapitalgeber direkt oder aber indirekt über Finanzintermediäre zusammen.</p>\n<p></p>','2015-07-26 16:03:35'),(3423,39805,'http://de.wikipedia.org/wiki/Deep_Web','<p>Das <b>Deep Web</b> (auch <i>Hidden Web</i> oder <i>Invisible Web</i>) bzw. <b>Verstecktes Web</b> bezeichnet den Teil des World Wide Webs, der bei einer Recherche über normale Suchmaschinen <i>nicht</i> auffindbar ist. Im Gegensatz zum Deep Web werden die über Suchmaschinen zugänglichen Webseiten <i>Visible Web</i> (Sichtbares Web) oder Surface Web (Oberflächenweb) genannt. Das Deep Web besteht zu großen Teilen aus themenspezifischen Datenbanken (Fachdatenbanken) und Webseiten. Zusammengefasst handelt es sich um Inhalte, die nicht frei zugänglich sind und/oder Inhalten, die nicht von Suchmaschinen indexiert werden oder die nicht indexiert werden wollen.</p>\n<p></p>','2015-02-27 12:46:04'),(3424,159632,'http://de.wikipedia.org/wiki/Beziehungsarbeit','<p><b>Beziehungsarbeit</b> bezeichnet ein Vorgehen in zwischenmenschlichen Beziehungen, in dem von den Beteiligten bewusst versucht wird, ihr Verhalten gegenüber dem jeweils anderen zu hinterfragen und im Sinne einer positiven Gestaltung der Beziehung veränderbar zu halten. Sie hat das Ziel, Vertrauen zu ermöglichen, größere Abstimmung (sachlich / emotional) und offeneren Austausch zu erreichen.</p>\n<p>Beziehungsarbeit bedeutet, gezielt auf einen Menschen zuzugehen, etwas gemeinsam mit ihm zu erleben, persönliche Berührungspunkte herzustellen oder andere in der Beziehungsbildung anzuleiten.</p>\n<p>Beziehungsarbeit kann auch das Hinterfragen eigener Verhaltensmuster sowie von \"Motivationen\" für bestimmte Verhaltensweisen dem anderen gegenüber beinhalten.</p>\n<p>Genauer gesagt: Man versucht eine sinnvolle Begegnung mit einem anderen herzustellen. Dazu gehört, dass einem der Andere wichtig ist, man sein Verhalten ernst nimmt, seine Gefühle respektiert und seine Persönlichkeit als wertvoll erachtet. Diese Arbeit verlangt auch, dass man sich mit seinen persönlichen Seiten einlässt, darum bemüht ist, Vertrauen herzustellen und persönliche Sichtweisen auszutauschen. Dazu gehört vor allem, seine eigenen Gefühle auszudrücken (z.B. im Zwiegespräch, Körpersprache ...).</p>\n<p>Mit dem Begriff Emotionsarbeit wird eine besondere Form der Beziehungsarbeit beschrieben, und zwar den planvollen Umgang mit Emotionen in personenbezogenen Dienstleistungsberufen.</p>','2015-07-02 16:00:18'),(3440,3012019,'http://de.wikipedia.org/wiki/Resilienz_(Psychologie_und_verwandte_Disziplinen)','<p><b>Resilienz</b> (von lat. <i>resilire</i> ‚zurückspringen‘ ‚abprallen‘) oder <b>psychische Widerstandsfähigkeit</b> ist die Fähigkeit, Krisen zu bewältigen und als Anlass für Entwicklungen zu nutzen durch Rückgriff auf persönliche und sozial vermittelte Ressourcen. Mit Resilienz verwandt sind Entstehung von Gesundheit (Salutogenese), Widerstandsfähigkeit (Hardiness), Bewältigungsstrategie (Coping) und Selbsterhaltung (Autopoiesis).</p>\n<p>Das Gegenteil von Resilienz ist Verwundbarkeit (Vulnerabilität).</p>\n<p></p>','2015-03-02 12:50:40'),(3551,16794,'http://de.wikipedia.org/wiki/Test','','0000-00-00 00:00:00'),(4520,20385,'http://de.wikipedia.org/wiki/Polizei','<p>Die <b>Polizei</b> ist ein Exekutivorgan eines Staates. Ihre Befugnisse sind unter anderem im Polizeirecht (Recht der Polizei) geregelt. Sie hat in den meisten Staaten die Aufgaben, die <i>öffentliche Sicherheit und Ordnung</i> zu gewährleisten oder wiederherzustellen, den Straßenverkehr zu regeln bzw. zu überwachen und als <i>Strafverfolgungsbehörde</i> strafbare und ordnungswidrige Handlungen zu erforschen. In der erstgenannten Funktion kommt ihr dabei oft die Rolle einer Notfallhilfe mit eigenem Notruf zu. Eine weitere Aufgabe in allen Staaten der Welt ist die Gefahrenabwehr im Bereich der inneren Sicherheit, das heißt die Verhütung oder Unterbindung von Taten, die entweder straf- oder bußgeldbewehrt sind oder auch Taten, die einem gesetzlichen Verbot unterliegen.</p>\n<p>Im Gegensatz zu fast allen anderen Personen oder Organen – mit, je nach Staat, wenigen Ausnahmen wie beispielsweise die Zollbehörden oder die Armee – ist der Polizei als Exekutivorgan des staatlichen Gewaltmonopols beim Einschreiten die Anwendung von Gewalt durch unmittelbaren Zwang, unter Beachtung der Verhältnismäßigkeit und innerhalb gesetzlicher Grenzen erlaubt. In fast allen Ländern wird die Polizei mittels ihrer Vollzugsbeamten tätig. Charakteristisch für diese ist die von ihnen getragene Polizeiuniform.</p>\n<p></p>','2015-07-31 17:24:09'),(4521,167786,'http://de.wikipedia.org/wiki/Individualisierung','<p>Der Begriff der <b>Individualisierung</b> stammt aus der Soziologie und bezeichnet einen mit der Industrialisierung und Modernisierung der westlichen Gesellschaften einhergehenden Prozess eines Übergangs des Individuums von der Fremd- zur Selbstbestimmung. Philosophischer Ausdruck der Individualisierung ist der Individualismus.</p>\n<p></p>','2015-07-31 13:04:17'),(4617,567694,'http://de.wikipedia.org/wiki/Vorratsdatenspeicherung','<p>Unter einer <b>Vorratsdatenspeicherung</b> (<b>VDS</b>; auch <b>Mindestdatenspeicherung</b> oder <b>Mindestspeicherfrist</b>) versteht man die Speicherung personenbezogener Daten durch oder für öffentliche Stellen, ohne dass die Daten aktuell benötigt werden. Sie werden also nur für den Fall gespeichert, dass sie einmal benötigt werden sollten. In der rechtspolitischen Debatte bezieht sich der Begriff meist auf die Vorratsdatenspeicherung von Telekommunikations-Verbindungsdaten. Diese betrifft die Verpflichtung der Anbieter von Telekommunikationsdiensten zur Registrierung der Verbindungsdaten elektronischer Kommunikationsvorgänge, ohne dass ein Anfangsverdacht oder eine konkrete Gefahr besteht (Speicherung bestimmter Daten auf Vorrat). Erklärter Zweck der Vorratsdatenspeicherung ist die verbesserte Möglichkeit der Verhütung und Verfolgung schwerer Straftaten.</p>\n<p>Die Vorratsdatenspeicherung ist eine Vorstufe der Telekommunikationsüberwachung und vermindert die Anonymität im Internet. Die auf Vorrat zu speichernden Daten (z. B. bei Telefonaten die Telefonnummern und Standortdaten der Gesprächspartner, bei Internetbenutzung die Zeit und benutzte IP-Adresse) erlauben demjenigen, der auf sie Zugriff hat, weitgehende Analysen persönlicher sozialer Netzwerke. Mit Hilfe der auf Vorrat zu speichernden Daten lässt sich – ohne dass auf Kommunikationsinhalte zugegriffen wird – das Kommunikationsverhalten jedes Teilnehmers analysieren. In dem Maße, in dem die Telekommunikation zunimmt, wird die Bedeutung solcher Analysen für die Erstellung von Persönlichkeitsprofilen wachsen.</p>\n<p>Per EU-Richtlinie vom Jahr 2006 wurden alle EU-Mitgliedsstaaten verpflichtet, Vorratsdatenspeicherungen einzuführen. In Deutschland trat ein entsprechendes Gesetz 2008 in Kraft.</p>\n<p>Das deutsche Bundesverfassungsgericht erklärte die deutschen Vorschriften zur Vorratsdatenspeicherung mit Urteil vom 2. März 2010 für verfassungswidrig und nichtig. Das Urteil verpflichtete deutsche Telekommunikationsanbieter zur sofortigen Löschung der bis dahin gesammelten Daten. Zur Begründung gab das Gericht an, dass das Gesetz zur anlasslosen Speicherung umfangreicher Daten sämtlicher Nutzer elektronischer Kommunikationsdienste keine konkreten Maßnahmen zur Datensicherheit vorsehe und zudem die Hürden für staatliche Zugriffe auf die Daten zu niedrig seien. Die Regelung zur Vorratsdatenspeicherung verstoße laut Bundesverfassungsgericht gegen <span>Art. 10</span> Abs. 1 Grundgesetz (GG).</p>\n<p>Am 8. April 2014 erklärte der Europäische Gerichtshof die EU-Richtlinie zur Vorratsdatenspeicherung für ungültig, da sie mit der Charta der Grundrechte der Europäischen Union nicht vereinbar sei. In Deutschland ist die Vorratsdatenspeicherung für sieben Tage erlaubt. Die Anbieter von Internetdiensten dürfen die IP-Adressen ihrer Kunden für interne Zwecke bis zu sieben Tage lang speichern, da die Speicherung nicht zur Strafverfolgung diene. Das hat der Bundesgerichtshof (BGH) mit Urteil vom 03. Juli 2014 (III ZR 391/13) entschieden.</p>\n<p>Ein neues Gesetz zur Vorratsdatenspeicherung wurde in Deutschland im Oktober 2015 verabschiedet. Von verschiedener Seite wurden Klagen gegen dieses Gesetz angekündigt.</p>\n<p></p>','2015-12-03 19:05:24'),(4826,42997,'http://de.wikipedia.org/wiki/Ziel','<p>Ein <b>Ziel</b> (griechisch <span lang=\"gr\" xml:lang=\"gr\"><i>τέλος</i></span> [<i>telos</i>], lateinisch <i>finis</i>, englisch <i>objective, goal, target</i>) ist ein in der Zukunft liegender, gegenüber dem Gegenwärtigen im Allgemeinen veränderter, erstrebenswerter und angestrebter Zustand (Zielvorgabe). Ein Ziel ist somit ein definierter und angestrebter Zustand innerhalb einer Ereignisfolge, meist einer menschlichen Handlung zu einem Zweck. \'Ziel\' benennt häufig den Erfolg eines Projekts bzw. einer mehr oder weniger aufwendigen Arbeit. Beispiele: Qualitätsziele, Unternehmensziele oder das Erreichen einer Zeitvorgabe oder Marke bei einem sportlichen Wettkampf. Mit dem Begriff Reise­ziel ist meist ein räumliches Ziel gemeint, also ein Zielort. Zweck wird in diesem Zusammenhang als Endziel oder Finalursache verstanden.</p>\n<p><i>Final</i> bedeutet in diesem Sinne <i>zielgerichtet</i> oder <i>zielorientiert</i>.</p>\n<p></p>','2015-05-17 21:06:23'),(5039,1122303,'https://de.wikipedia.org/wiki/MySQL_AB','<p>Das schwedische Unternehmen <b>MySQL AB</b> wurde im Februar 2008 durch Sun Microsystems übernommen. Es stellte Produkte und Dienstleistungen im Bereich Datenbanksysteme zur Verfügung. Sie war insbesondere für das Datenbankmanagementsystem MySQL Server bekannt. Das System wird, inzwischen durch die Oracle Corporation, sowohl als freie Software (unter der GPL), als auch unter einer kommerziellen Lizenz angeboten. Die GPL-Version beinhaltet - wie üblich - keinerlei Garantie oder Support, während die kommerzielle Version mit umfassenden Garantieleistungen ausgestattet ist.</p>\n','2015-08-04 16:59:57'),(5040,44422,'https://de.wikipedia.org/wiki/Moderne','<p>Der Begriff <b>Moderne</b> in der Geschichte Europas, Amerikas und Australiens bezeichnet einen Umbruch in allen Lebensbereichen gegenüber der Tradition. In der Querelle des Anciens et des Modernes (1687) war „Moderne“ noch ein Gegenbegriff zu „Antike“. Erst im 19. Jahrhundert wurde es üblich, mit dem Wort Moderne die Gegenwart von der Vergangenheit allgemein abzugrenzen. In der Philosophie fällt die Moderne mit der Aufklärung zusammen.</p>\n<p></p>','2015-12-06 14:17:44'),(5047,23913,'https://de.wikipedia.org/wiki/Psychotherapie','<p><b>Psychotherapie</b> (von griechisch <span lang=\"grc\" xml:lang=\"grc\">ψυχή</span> <i>psychḗ</i> ‚Atem, Hauch, Seele‘ und <span lang=\"grc\" xml:lang=\"grc\">θεραπεύειν</span> <i>therapeúein</i> ‚pflegen, sorgen‘) ist eine Tätigkeit zur Feststellung, Heilung oder Linderung von psychischen Störungen mit Krankheitswert. Davon zu unterscheiden ist die <i>Beratende Psychologie</i>, die sich mit allgemeinen Problemen der Lebensführung befasst.</p>\n<p></p>','2015-08-05 08:36:26'),(5054,1220127,'https://de.wikipedia.org/wiki/Leistungsgesellschaft','<p><b>Leistungsgesellschaft</b> (engl. <i>achieving society</i>, <i>meritocracy</i>) ist die Modellvorstellung einer Gesellschaft, in welcher die Verteilung angestrebter Güter wie Macht, Einkommen, Prestige und Vermögen entsprechend der besonderen Leistung erfolgt, die einem jeden Gesellschaftsmitglied jeweils zugerechnet wird („Leistungsprinzip“, „Leistungsgerechtigkeit“).</p>\n<p></p>','2015-08-06 10:43:11'),(5096,1783100,'https://de.wikipedia.org/wiki/Facebook','<p><b>Facebook</b> (Eigenschreibweise <i>facebook</i>, früher <i>thefacebook</i>) ist ein soziales Netzwerk, das vom gleichnamigen US-amerikanischen Unternehmen Facebook Inc. betrieben wird. Der Name bezieht sich auf die sogenannten <i>Facebooks</i> (Englisch wörtlich: „Gesichtsbuch“, sinngemäß: „Jahrbuch“) mit Abbildungen von Studenten, die an manchen US-amerikanischen Colleges verteilt werden.</p>\n<p>Facebook ermöglicht die Erstellung von privaten Profilen zur Darstellung der eigenen Person, von Unternehmensseiten zur geschäftlichen Präsenz, sowie von Gruppen zur privaten Diskussion gemeinsamer Interessen. Die Profile können durch Freundschaftsanfragen untereinander vernetzt werden, wobei eine unbeschränkte Anzahl von Abonnenten (analog den Followern auf Twitter) möglich ist, die Höchstgrenze ist jedoch auf 5.000 Freunde (direkte Verbindungen) festlegt. Darüber hinaus bietet Facebook einen Messenger für Videotelefonie sowie eine Entwicklungsplattform zur Erstellung von Apps.</p>\n<p>Das soziale Netzwerk wurde am 4. Februar 2004 von Dustin Moskovitz, Chris Hughes, Eduardo Saverin und Mark Zuckerberg veröffentlicht und zählte nach eigenen Angaben im 1. Quartal 2015 rund 1,44 Milliarden Mitglieder, welche die Seite zumindest ein Mal pro Monat besuchen. Laut Alexa liegt Facebook im 4. Quartal 2015 weltweit auf Rang 2 sowie deutschlandweit auf Rang 3 der meistbesuchten Websites und verzeichnete weiteren Statistiken zufolge im Mai 2014 in Deutschland 28 Millionen aktive Nutzer sowie im 3. Quartal 2015 rund 1,5 Milliarden aktive Nutzer weltweit. Facebook gewinnt weiteren repräsentativen Erhebungen zufolge zunehmend Bedeutung als Nachrichtenkanal. Laut einer Studie für das Jahr 2015 des <i>Reuters Institute</i> der Universität Oxford wurde Facebook als Nachrichtenkanal deutschlandweit bei 23 % von 1969 Befragten aller Altersgruppen genutzt, in den USA bei 41 % von 23.557 Befragten aller Altersgruppen sowie 52 % bei den 18–24 Jährigen. Laut einer Langzeitstudie der TU Darmstadt und der TU Dresden wurden im Jahr 2014 in Deutschland rund 91 Prozent aller Online-Nachrichten der Mediengesellschaften über die Facebook-Like und Teilen-Buttons verbreitet.</p>\n<p>Seit seiner Veröffentlichung steht Facebook aufgrund mangelhafter Datenschutzpraktiken in der Kritik, insbesondere von europäischen Datenschützern und Sicherheitsexperten. Der Bundesverband der Verbraucherzentralen in Deutschland riet 2010 davon ab, das Angebot zu nutzen. Zahlreiche andere Plattformen bieten Alternativen zur Nutzung von Facebook.</p>\n<p></p>\n','2015-12-15 17:05:49'),(5097,174138,'https://de.wikipedia.org/wiki/Verschlüsselung','<p><b>Verschlüsselung</b> (auch: <b>Chiffrierung</b>) ist die von einem Schlüssel abhängige Umwandlung von „Klartext“ genannten Daten in einen „Geheimtext“ (auch: „Chiffrat“), so dass der Klartext aus dem Geheimtext nur unter Verwendung eines geheimen Schlüssels wiedergewonnen werden kann. Sie dient zur Geheimhaltung von Nachrichten, beispielsweise um Daten gegenüber unbefugtem Zugriff zu schützen oder um Nachrichten vertraulich übermitteln zu können.</p>\n<p></p>','2015-08-13 21:22:38'),(5098,143866,'https://de.wikipedia.org/wiki/Burnout-Syndrom','<p>Ein <b>Burnout-Syndrom</b> (engl. <i><span lang=\"en\" xml:lang=\"en\">burn out</span></i> ‚ausbrennen‘) bzw. <b>Ausgebranntsein</b> ist ein Zustand ausgesprochener emotionaler Erschöpfung mit reduzierter Leistungsfähigkeit. Es kann als Endzustand einer Entwicklungslinie bezeichnet werden, die mit idealistischer Begeisterung beginnt und über frustrierende Erlebnisse zu Desillusionierung und Apathie, psychosomatischen Erkrankungen und Depression oder Aggressivität und einer erhöhten Suchtgefährdung führt. Das Burnout-Syndrom ist wissenschaftlich nicht als Krankheit anerkannt, sondern gilt im ICD-10 als ein Problem der Lebensbewältigung. Es handelt sich um eine körperliche, emotionale und geistige Erschöpfung aufgrund beruflicher oder anderweitiger Überlastung bei der Lebensbewältigung. Diese wird meist durch Stress ausgelöst, der wegen der verminderten Belastbarkeit nicht bewältigt werden kann.</p>\n<p></p>','2015-08-13 21:30:32'),(5155,843020,'https://de.wikipedia.org/wiki/Wikipedia','<p><b>Wikipedia</b> [<span><span title=\"Aussprache im Internationalen Phonetischen Alphabet (IPA)\">ˌvɪkiˈpeːdia</span></span>] ist ein am 15. Januar 2001 gegründetes Projekt zur Erstellung eines freien Onlinelexikons in zahlreichen Sprachen. Die Wikipedia ist gegenwärtig das meistbenutzte Online-Nachschlagewerk und liegt auf Platz sieben der meistbesuchten Websites der Welt und Deutschlands sowie auf Platz sechs in den USA. Sie ist dabei weltweit wie in Deutschland mit der Top Level Domain <i>.org</i> die einzige nichtkommerzielle Website unter den Top 50.</p>\n<p>Etwa 35 Millionen Artikel der Wikipedia in mehr als 280 Sprachen werden in Mehrautorenschaft von unentgeltlich arbeitenden Freiwilligen konzipiert, verfasst und nach dem Prinzip des kollaborativen Schreibens fortwährend gemeinschaftlich korrigiert, erweitert und aktualisiert.</p>\n<p>Das Ziel von Wikipedia ist es, eine frei lizenzierte und qualitativ hochwertige Enzyklopädie zu schaffen und zu verbreiten. Jeder Internetnutzer kann Wikipedia nicht nur lesen, sondern auch als Autor daran mitwirken. Um Inhalte zu verändern, ist eine Anmeldung nicht erforderlich. In einem offenen Bearbeitungsprozess hat Bestand, was von der Gemeinschaft der Mitarbeitenden akzeptiert wird.</p>\n<p>Bisher haben international mehr als 2,0 Millionen angemeldete und eine unbekannte Zahl nicht angemeldeter Nutzer zur Wikipedia beigetragen. Rund 5800 Autoren arbeiten regelmäßig an der deutschsprachigen Ausgabe (Stand: Mai 2015).</p>\n<p>Die englischsprachige Version wird mit Abstand am häufigsten aufgerufen, gefolgt von der japanischsprachigen Ausgabe und der russischsprachigen Wikipedia. Dabei ist die englischsprachige Wikipedia mit 5,01 Millionen Artikeln die größte Sprachversion, gefolgt von der schwedischen Wikipedia mit 2,10 Millionen Artikeln sowie von der deutschsprachigen Wikipedia mit 1,87 Millionen Artikeln und der niederländischsprachigen mit 1,84 Millionen Artikeln (jeweils Stand 21. November 2015). Neben ihrer Funktion als Enzyklopädie spielt die Wikipedia eine wachsende Rolle als Medium für die Verbreitung von Nachrichten, auch in aktuellen Krisensituationen.</p>\n<p>Alle Inhalte der Wikipedia stehen unter freien Lizenzen – Artikeltexte unter der GNU-Lizenz für freie Dokumentation sowie seit dem 15. Juni 2009 auch unter der Creative-Commons-Attribution-ShareAlike-Lizenz (CC-BY-SA), Bilder unter unterschiedlichen Lizenzen – und können somit (unter bestimmten Bedingungen) kommerziell genutzt, verändert und verbreitet werden.</p>\n<p>Betreiber ist die Wikimedia Foundation, Inc., eine Non-Profit-Organisation mit Sitz in San Francisco, Kalifornien. In vielen Ländern gibt es zudem unabhängige Wikimedia-Vereine, die mit der Stiftung zusammenarbeiten. Im deutschen Sprachraum sind dies Wikimedia Deutschland, Wikimedia Österreich und die Wikimedia CH.</p>\n<p></p>\n','2015-12-03 08:01:31'),(5156,1213104,'https://de.wikipedia.org/wiki/Coaching','<p>Der Begriff <b>Coaching</b> wird heute als Sammelbegriff für unterschiedliche Beratungsmethoden (Einzelcoaching, Teamcoaching, Projektcoaching) verwendet. Im Unterschied zur klassischen Beratung werden keine direkten Lösungsvorschläge durch den Coach geliefert, sondern die Entwicklung eigener Lösungen wird begleitet.  </p>\n<p></p>','2015-12-15 17:07:26'),(5157,50049,'https://de.wikipedia.org/wiki/Konflikt','<p>Von einem <b>Konflikt</b> (von lat. <i>confligere</i>, „zusammentreffen, kämpfen“; PPP: <i>conflictum</i>) spricht man, wenn Interessen, Zielsetzungen oder Wertvorstellungen von Personen, gesellschaftlichen Gruppen, Organisationen oder Staaten miteinander unvereinbar sind oder unvereinbar erscheinen (Intergruppenkonflikt). Dabei lässt sich zwischen der Konfliktstruktur, den Konflikt begleitenden Gefühlen (z. B. Wut) und dem konkreten Konfliktverhalten (z. B. tätliche Aggression) unterscheiden.</p>\n<p>Die Konfliktforschung untersucht die Entstehung und den Verlauf von Konflikten und entwickelt Lösungsstrategien, um das Handeln in Konflikten zu verändern, um erwünschte Entwicklungen zu fördern und unerwünschte zu begrenzen.</p>\n<p></p>','2015-12-08 20:48:44'),(5242,3412152,'https://de.wikipedia.org/wiki/Russland','<p><b>Russland</b> (russisch <span lang=\"ru\">Россия</span> [<span><span title=\"Aussprache im Internationalen Phonetischen Alphabet (IPA)\">rɐˈsʲijə</span></span>] <span> Aussprache<sup><span title=\"Hilfe – Audio\">?</span>/<span title=\"Tondateibeschreibungsseite mit Lizenzangabe für „Ru-Rossiya.ogg“\">i</span></sup></span>, Transkription <i><span lang=\"ru-Latn\">Rossija</span></i>) bzw. die <b>Russische Föderation</b> (oder seltener <i>Russländische Föderation</i>; russisch <span lang=\"ru\">Российская Федерация</span>, <span> Aussprache<sup><span title=\"Hilfe – Audio\">?</span>/<span title=\"Tondateibeschreibungsseite mit Lizenzangabe für „Ru-Rossiyskaya Federatsiya.ogg“\">i</span></sup></span>, Transkription <i><span lang=\"ru-Latn\">Rossijskaja Federazija</span></i>) ist ein föderativer Staat im nordöstlichen Eurasien und flächenmäßig der größte der Erde. Nach der russischen Verfassung sind die beiden Bezeichnungen Russland und Russische Föderation gleichwertig. Russland zählt mit seinen rund 144 Millionen Einwohnern auf etwa 17 Millionen km² zu den weltweit am dünnsten besiedelten Flächenstaaten. Die Hauptstadt des Landes ist Moskau. Als weiteres wichtiges Zentrum gilt Sankt Petersburg, das zwischen 1712 und 1917 Hauptstadt war und eine architektonische und kulturelle Brücke Russlands nach Westeuropa bildet.</p>\n<p>Das heutige Russland entwickelte sich aus dem Großfürstentum Moskau, einem Teilfürstentum des früheren ostslawischen Reiches Kiewer Rus, zu einem über einhundert Ethnien zählenden Vielvölkerstaat, wobei ethnische Russen heute ca. 81 Prozent der Bevölkerung ausmachen.</p>\n<p>Die Russische Föderation ist „Fortsetzerstaat“ der Sowjetunion in internationalen Organisationen, Atommacht und ständiges Mitglied des Weltsicherheitsrates. Nach der Erholung von der postkommunistischen Transformationskrise der 1990er Jahre und in einer eingeschränkten oder defekten Variante von Demokratie wurde Russland nach Kaufkraftparität eine der sechs größten Volkswirtschaften der Welt mit durch ihren Reichtum an natürlichen Ressourcen hoher internationaler Bedeutung.</p>\n<p></p>','2015-09-10 13:42:22'),(5605,3370686,'https://de.wikipedia.org/wiki/Glücksforschung','<p><b>Glücksforschung</b> ist die Erforschung der Bedingungen, unter denen sich Menschen als glücklich bezeichnen und/oder glücklich sind. Die Wissenschaft vom Glück hat einen humanistischen Anspruch. Sie möchte zur Maximierung des menschlichen Glücks beitragen. In Deutschland ist sie seit den 1980er Jahren durch die Arbeit des Soziologen Alfred Bellebaum stark intensiviert worden.</p>\n<p></p>','2015-12-16 09:06:45');
