INSERT INTO `options` VALUES (1,'help',''),(2,'terms','<div align=\"center\"><strong>Nutzungsbedingungen Internet-Forum</strong></div>\n<p><br /> <br /> <strong>&sect; 1<br /> Geltungsbereich</strong></p>\n<div align=\"justify\">F&uuml;r die Nutzung dieser Website gelten im Verh&auml;ltnis zwischen dem Nutzer und dem Betreiber der Seite (im Folgenden: Anbieter) die folgenden Nutzungsbedingungen. Die Nutzung des Forums und der Communityfunktionen ist nur zul&auml;ssig, wenn der Nutzer diese Nutzungsbedingungen akzeptiert.</div>\n<p><br /><br /> <strong>&sect; 2<br /> Registrierung, Teilnahme, Mitgliedschaft in der Community</strong></p>\n<div align=\"justify\">(1) Voraussetzung f&uuml;r die Nutzung des Forums und der Community ist eine vorherige Registrierung. Mit der erfolgreichen Registrierung wird der Nutzer Mitglied der Community. <br /><br /> (2) Es besteht kein Anspruch auf eine Mitgliedschaft. <br /><br /> (3) Der Nutzer darf seinen Zugang nicht Dritten zur Nutzung &uuml;berlassen. Der Nutzer ist verpflichtet, seine Zugangsdaten geheim zu halten und vor dem Zugriff Dritter zu sch&uuml;tzen.</div>\n<p><br /><br /> <strong>&sect; 3<br /> Leistungen des Anbieters</strong></p>\n<div align=\"justify\">(1) Der Anbieter gestattet dem Nutzer, im Rahmen dieser Nutzungsbedingungen Beitr&auml;ge auf seiner Webseite zu ver&ouml;ffentlichen. Der Anbieter stellt den Nutzern dazu im Rahmen seiner technischen und wirtschaftlichen M&ouml;glichkeiten unentgeltlich ein Diskussionsforum mit Communityfunktionen zur Verf&uuml;gung. Der Anbieter ist bem&uuml;ht, seinen Dienst verf&uuml;gbar zu halten. Der Anbieter &uuml;bernimmt keine dar&uuml;ber hinausgehenden Leistungspflichten. Insbesondere besteht kein Anspruch des Nutzers auf eine st&auml;ndige Verf&uuml;gbarkeit des Dienstes. <br /><br /> (2) Der Anbieter &uuml;bernimmt keine Gew&auml;hr f&uuml;r die Richtigkeit, Vollst&auml;ndigkeit, Verl&auml;sslichkeit, Aktualit&auml;t und Brauchbarkeit der bereit gestellten Inhalte.</div>\n<p><br /><br /> <strong>&sect; 4<br /> Haftungsausschluss</strong></p>\n<div align=\"justify\">(1) Schadensersatzanspr&uuml;che des Nutzers sind ausgeschlossen, soweit nachfolgend nichts anderes bestimmt ist. Der vorstehende Haftungsausschluss gilt auch zugunsten der gesetzlichen Vertreter und Erf&uuml;llungsgehilfen des Anbieters, sofern der Nutzer Anspr&uuml;che gegen diese geltend macht. <br /><br /> (2) Von dem in Absatz 1 bestimmten Haftungsausschluss ausgenommen sind Schadensersatzanspr&uuml;che aufgrund einer Verletzung des Lebens, des K&ouml;rpers, der Gesundheit und Schadensersatzanspr&uuml;che aus der Verletzung wesentlicher Vertragspflichten. Wesentliche Vertragspflichten sind solche, deren Erf&uuml;llung zur Erreichung des Ziels des Vertrags notwendig ist. Von dem Haftungsausschluss ebenfalls ausgenommen ist die Haftung f&uuml;r Sch&auml;den, die auf einer vors&auml;tzlichen oder grob fahrl&auml;ssigen Pflichtverletzung des Anbieters, seiner gesetzlichen Vertreter oder Erf&uuml;llungsgehilfen beruhen.</div>\n<p><br /><br /> <strong>&sect; 5<br /> Pflichten des Nutzers</strong></p>\n<div align=\"justify\">(1) Der Nutzer verpflichtet sich gegen&uuml;ber dem Anbieter, keine Beitr&auml;ge zu ver&ouml;ffentlichen, die gegen die guten Sitten oder geltendes Recht versto&szlig;en. Der Nutzer verpflichtet sich insbesondere dazu, keine Beitr&auml;ge zu ver&ouml;ffentlichen,\n<ul>\n<li>deren Ver&ouml;ffentlichung einen Straftatbestand erf&uuml;llt oder eine Ordnungswidrigkeit darstellt,</li>\n<li>die gegen das Urheberrecht, Markenrecht oder Wettbewerbsrecht versto&szlig;en,</li>\n<li>die gegen das Rechtsdienstleistungsgesetz versto&szlig;en,</li>\n<li>die beleidigenden, rassistischen, diskriminierenden oder pornographischen Inhalt haben,</li>\n<li>die Werbung enthalten.</li>\n</ul>\n<br /> (2) Bei einem Versto&szlig; gegen die Verpflichtung aus Absatz 1 ist der Anbieter berechtigt, die entsprechenden Beitr&auml;ge abzu&auml;ndern oder zu l&ouml;schen und den Zugang des Nutzers zu sperren. Der Nutzer ist verpflichtet, dem Anbieter den durch die Pflichtverletzung entstandenen Schaden zu ersetzen. <br /><br /> (3) Der Anbieter hat das Recht, Beitr&auml;ge und Inhalte zu l&ouml;schen, wenn diese einen Rechtsversto&szlig; enthalten k&ouml;nnten. <br /><br /> (4) Der Anbieter hat gegen den Nutzer einen Anspruch auf Freistellung von Anspr&uuml;chen Dritter, die diese wegen der Verletzung eines Rechts durch den Nutzer geltend machen. Der Nutzer verpflichtet sich, den Anbieter bei der Abwehr derartiger Anspr&uuml;che zu unterst&uuml;tzen. Der Nutzer ist au&szlig;erdem verpflichtet, die Kosten einer angemessenen Rechtsverteidigung des Anbieters zu tragen.</div>\n<p><br /><br /> <strong>&sect; 6<br /> &Uuml;bertragung von Nutzungsrechten</strong></p>\n<div align=\"justify\">(1) Das Urheberrecht f&uuml;r die eingestellten Beitr&auml;ge verbleibt beim jeweiligen Nutzer. Der Nutzer r&auml;umt dem Anbieter mit dem Einstellen seines Beitrags in das Forum jedoch das Recht ein, den Beitrag dauerhaft auf seiner Webseite zum Abruf bereitzuhalten und &ouml;ffentlich zug&auml;nglich zu machen. Der Anbieter hat das Recht, Beitr&auml;ge innerhalb seiner Webseite zu verschieben und mit anderen Inhalten zu verbinden. <br /><br /> (2) Der Nutzer hat gegen den Anbieter keinen Anspruch auf L&ouml;schung oder Berichtigung von ihm erstellter Beitr&auml;ge.</div>\n<p><br /><br /> <strong>&sect; 7<br /> Beendigung der Mitgliedschaft</strong></p>\n<div align=\"justify\">(1) Der Nutzer kann seine Mitgliedschaft durch eine entsprechende Erkl&auml;rung gegen&uuml;ber dem Anbieter ohne Einhaltung einer Frist beenden. Auf Verlangen wird der Anbieter daraufhin den Zugang des Nutzers sperren. <br /><br /> (2) Der Anbieter ist berechtigt, die Mitgliedschaft eines Nutzers unter Einhaltung einer Frist von 2 Wochen zum Monatsende zu k&uuml;ndigen. <br /><br /> (3) Bei Vorliegen eines wichtigen Grundes ist der Anbieter berechtigt, den Zugang des Nutzers sofort zu sperren und die Mitgliedschaft ohne Einhaltung einer Frist zu k&uuml;ndigen. <br /><br /> (4) Der Anbieter ist nach Beendigung der Mitglieschaft berechtigt, den Zugang des Nutzers zu sperren. Der Anbieter ist berechtigt aber nicht verpflichtet, im Falle der Beendigung der Mitgliedschaft die vom Nutzer erstellten Inhalte zu l&ouml;schen. Ein Anspruch des Nutzers auf &Uuml;berlassung der erstellten Inhalte wird ausgeschlossen.</div>\n<p><br /><br /> <strong>&sect; 8<br /> &Auml;nderung oder Einstellung des Angebots</strong></p>\n<div align=\"justify\">(1) Der Anbieter ist berechtigt, &Auml;nderungen an seinem Dienst vorzunehmen. <br /><br /> (2) Der Anbieter ist berechtigt, seinen Dienst unter Einhaltung einer Ank&uuml;ndigungsfrist von 2 Wochen zu beenden. Im Falle der Beendigung seines Dienstes ist der Anbieter berechtigt aber nicht verpflichtet, die von den Nutzern erstellten Inhalte zu l&ouml;schen.</div>\n<p><br /><br /> <strong>&sect; 9<br /> Rechtswahl</strong></p>\n<div align=\"justify\">Auf die vertraglichen Beziehungen zwischen dem Anbieter und dem Nutzer findet das Recht der Bundesrepublik Deutschland Anwendung. Von dieser Rechtswahl ausgenommen sind die zwingenden Verbraucherschutzvorschriften des Landes, in dem der Nutzer seinen gew&ouml;hnlichen Aufenthalt hat.</div>\n<p><br /><br /> <em>Quelle: <a href=\"http://www.kluge-recht.de/muster-nutzungsbedingungen-forum.php\">Nutzungsbedingungen Internet-Forum</a></em></p>'),(3,'invitation','0'),(4,'terms_accepted','0'),(5,'current_downloads_size','1696.7965135574');
