INSERT INTO `project_data` VALUES (1,'<div class=\"clearfix module-box wirtschaft\">\r\n<div class=\"ressort-teaser-box-header hp-gradient double-bottom-border clearfix\">\r\n<p class=\"module-title block-bullet\"><a href=\"http://www.spiegel.de/wirtschaft/#ref=ressortblock\"> WIRTSCHAFT</a></p>\r\n<p class=\"module-title no-bullet\"><a href=\"http://boersen.manager-magazin.de/spon/#ref=ressortblock\"> B&Ouml;RSE</a></p>\r\n<div class=\"ressort-teaser-box-nav\">\r\n<ul>\r\n<li><a href=\"http://www.spiegel.de/thema/euro_krise_2010/\">Euro-Krise</a></li>\r\n<li><a href=\"http://www.spiegel.de/wirtschaft/service/\">Verbraucher</a></li>\r\n<li><a class=\"link-more\">mehr</a></li>\r\n</ul>\r\n</div>\r\n</div>\r\n<div class=\"clearfix ressort-teaser-box-body\">\r\n<div class=\"column-wide\">\r\n<div class=\"commonpager\" style=\"visibility: visible;\" data-commonpager-beforeslide=\"spHpSlideBox\" data-enable-touch=\"false\" data-commonpager-callback=\"spHpSlideBoxCallback\">\r\n<div class=\"commonpager-pages\" style=\"width: 1890px;\">\r\n<div class=\"commonpager-page first ressort-slide initialized\" style=\"width: 630px; left: 0px; transition-duration: 0ms; transform: translateX(0px);\" data-index=\"0\">\r\n<div class=\"ressort-teaser-box-top\">\r\n<div class=\"article-image-box box-position thumb asset-align-left\">\r\n<div class=\"image-buttons-panel clearfix\"><a title=\"Faule Hypothekenpapiere: Bank of America zahlt Rekordstrafe von 17 Milliarden\" href=\"http://www.spiegel.de/wirtschaft/unternehmen/bank-of-america-rekordstrafe-wegen-fauler-wertpapiere-a-987350.html\"><img class=\"js-lazy\" style=\"display: inline;\" title=\"Faule Hypothekenpapiere: Bank of America zahlt Rekordstrafe von 17 Milliarden\" src=\"http://cdn1.spiegel.de/images/image-449054-thumb-fwgg.jpg\" alt=\"Faule Hypothekenpapiere: Bank of America zahlt Rekordstrafe von 17 Milliarden\" width=\"180\" height=\"180\" border=\"0\" data-original=\"http://cdn1.spiegel.de/images/image-449054-thumb-fwgg.jpg\" /></a></div>\r\n</div>\r\n<h2 class=\"article-title\"><a title=\"Faule Hypothekenpapiere: Bank of America zahlt Rekordstrafe von 17 Milliarden\" href=\"http://www.spiegel.de/wirtschaft/unternehmen/bank-of-america-rekordstrafe-wegen-fauler-wertpapiere-a-987350.html\"><span class=\"headline-intro\">Faule Hypothekenpapiere</span> <span class=\"headline\">Bank of America zahlt Rekordstrafe von 17 Milliarden</span></a></h2>\r\n<p>So viel Geld hat noch kein Unternehmen in einem Zivilprozess an die US-Justiz &uuml;berwiesen: Die Bank of America zahlt wegen Gesch&auml;ften mit faulen Wertpapieren eine Rekordstrafe von 17 Milliarden Dollar. <a title=\"Faule Hypothekenpapiere: Bank of America zahlt Rekordstrafe von 17 Milliarden\" href=\"http://www.spiegel.de/wirtschaft/unternehmen/bank-of-america-rekordstrafe-wegen-fauler-wertpapiere-a-987350.html\">mehr...</a> <span class=\"spInteractionMarks video-forum-bracket\">[&nbsp;<a href=\"http://www.spiegel.de/forum/wirtschaft/faule-hypothekenpapiere-bank-of-america-zahlt-rekordstrafe-von-17-milliarden-thread-136137-1.html\">Forum</a>&nbsp;]</span></p>\r\n</div>\r\n<ul class=\"article-list\">\r\n<li><a title=\"Kapitalerh&ouml;hung: Borussia Dortmund will 114,4 Millionen Euro einsammeln\" href=\"http://www.spiegel.de/wirtschaft/unternehmen/bundesliga-borussia-dortmund-kuendigt-kapitalerhoehung-an-a-987316.html\"><span class=\"headline-intro\">Kapitalerh&ouml;hung:</span> <span class=\"headline\">Borussia Dortmund will 114,4 Millionen Euro einsammeln</span></a></li>\r\n<li><a title=\"D&auml;nisch-deutsches Riesenprojekt: B&uuml;rger wollen Fehmarnbelt-Tunnel stoppen\" href=\"http://www.spiegel.de/wirtschaft/fehmarnbelt-gegner-wollen-gegen-tunnelbau-klagen-a-984538.html\"><span class=\"headline-intro\">D&auml;nisch-deutsches Riesenprojekt:</span> <span class=\"headline\">B&uuml;rger wollen Fehmarnbelt-Tunnel stoppen</span></a></li>\r\n<li><a title=\"ADAC-Test in Gro&szlig;st&auml;dten: Bei fast allen Taxifahrten l&auml;uft etwas sc