 rel=\"0\"> Bild 1 vergr&ouml;&szlig;ern </a>\n<p>Thomas Tuchel ist neuer Coach bei Borussia Dortmund</p>\n</dd></dl>\n<p>Nur vier Tage nach der Ank&uuml;ndigung von J&uuml;rgen Klopp, seine Amtszeit beim BVB&nbsp;zum Saisonende vorzeitig zu beenden, ist die Nachfolgediskussion beendet. Wie erwartet, entschied sich die Vereinsf&uuml;hrung f&uuml;r den in den vergangenen Monaten von vielen Clubs umworbenen 41 Jahre alten Tuchel. Der einstige Coach des FSV Mainz und der in dieser Saison im Mittelma&szlig; versunkene Branchenriese einigten sich auf einen Dreijahresvertrag bis zum Juni 2018.</p>\n<h2>R&uuml;ckkehr nach einj&auml;hriger Pause</h2>\n<p>Mit R&uuml;cksicht auf den noch amtierenden Klopp will die Borussia den neuen Fu&szlig;ball-Lehrer erst in der Woche nach dem Saisonende offiziell vorstellen. \"Der BVB bittet um Verst&auml;ndnis daf&uuml;r, dass sich alle Beteiligten bis zu diesem Zeitpunkt nicht zur Sache &auml;u&szlig;ern werden\", hie&szlig; es in einer nur f&uuml;nfzeiligen Erkl&auml;rung der Borussia am Sonntag (19.04.2015). Damit steht Tuchel nach gut einj&auml;hriger Pause vor einer R&uuml;ckkehr auf die Bundesliga-B&uuml;hne. Er hatte seine Arbeit in Mainz am Ende der Saison 2013/14 auf eigenen Wunsch vorzeitig beendet. Sein noch ein Jahr l&auml;nger datierter Vertrag war jedoch nicht vorzeitig aufgel&ouml;st worden, was einen Wechsel zu einem anderen Verein nur gegen Zahlung einer Abl&ouml;se m&ouml;glich gemacht h&auml;tte.</p>\n<div id=\"teaserThree1\" class=\"stripTeaserThree\">\n<ul class=\"teaserContOuter\">\n<li class=\"teaserCont firstImgTeaser hover\"><img title=\"Bildrechte: imago\" src=\"http://www.sportschau.de/fussball/klopp-tuchel100_v-TeaserKlein.jpg\" alt=\"Thomas Tuchel und J&uuml;rgen Klopp\" width=\"146\" height=\"82\" /> <a class=\"textPageLink\" href=\"http://www1.wdr.de/themen/sport/tuchel-reaktionen-100.html\"> Reaktionen im Netz zur Verpflichtung von Thomas Tuchel </a></li>\n<li class=\"teaserCont  hover\"><img title=\"Bildrechte: imago\" src=\"http://www.sportschau.de/fussball/bundesliga/juergen-klopp140_v-TeaserKlein.jpg\" alt=\"J&uuml;rgen Klopp lehnt an einer Trainerbank\" width=\"146\" height=\"82\" /> <a class=\"textPageLink\" href=\"http://www.sportschau.de/fussball/bundesliga/kommentar-vertragsaufloesung-klopp-borussia-dortmund-100.html\"> Kommentar zur Vertragsaufl&ouml;sung von J&uuml;rgen Klopp </a></li>\n<li class=\"teaserCont last hover\"><img title=\"Bildrechte: dpa\" src=\"http://www.sportschau.de/fussball/bundesliga/vereine/dortmund/trainer/juergen-klopp-114_v-TeaserKlein.jpg\" alt=\"J&uuml;rgen Klopp mit der Meisterschaftsschale\" width=\"146\" height=\"82\" /> <a class=\"galleryPageLink\" href=\"http://www.sportschau.de/fussball/bundesliga/klopp-trainer-borussia-dortmund-erfolge100.html\"> Klopp beim BVB - das Ende einer &Auml;ra </a></li>\n</ul>\n</div>\n<p>Es geh&ouml;rt zum erstaunlichen Karrieresprung vom Tuchel, dass sein Wert w&auml;hrend seiner einj&auml;hrigen Besch&auml;ftigungslosigkeit kontinuierlich anstieg. Es gab Ger&uuml;chte, dass der FC Schalke, Galatasaray Istanbul, RasenBallsport Leipzig und zuletzt der Hamburger SV den studierten Betriebswirt gerne verpflichtet h&auml;tten. Wie Klopp steht Tuchel f&uuml;r modernen Angriffs- und Tempofu&szlig;ball. Nicht nur deshalb wurden sie oft miteinander verglichen. Beide deb&uuml;tierten in Mainz als Trainer einer Profimannschaft, beide haben einen akademischen Hintergrund und beide verf&uuml;gen &uuml;ber gro&szlig;es rhetorisches Geschick.</p>\n<h2>2011 Trainer des Jahres</h2>\n<p>Tuchel kann auf sechs Jahre als Fu&szlig;ballprofi zur&uuml;ckblicken und spielte von 1992 bis 1998 bei den Stuttgarter Kickers und dem SSV Ulm. Seine Trainerlaufbahn begann 2000 beim Nachwuchs des VfB Stuttgart, den er bis 2006 betreute. Dann wechselte er nach Augsburg und war dort zwei Jahre f&uuml;r die U19 und die 2. Mannschaft verantwortlich. 2008 begann dann seine Zeit beim FSV Mainz 05, wo er zun&auml;chst die U19 betreute, das Team zur Deutschen Meisterschaft f&uuml;hrte und in der Saison darauf als Cheftrainer f&uuml;r das Profiteam vorgestellt wurde. 2011 ehrte der DFB Tuchel als \"Trainer des Jahres\".</p>\n<h2>Schweres Erbe f&uuml;r Tuchel</h2>\n<hr /><dl class=\"illustrationCont\"><dt><img title=\"Bildrechte: dpa\" src=\"http://www1.wdr.de/themen/sport/tuchel-100_v-TeaserAufmacher.jpg\" alt=\"Thomas Tuchel als Trainer von Mainz 05 bei einem Gastspiel in Dortmund\" /></dt><dd><a class=\"magnifyingLink\" title=\"Bild vergr&ouml;&szlig;ern\" href=\"http://www1.wdr.de/themen/sport/tuchel-bvb-100_lpic-2_lupe-true.html#picMagnifyCont\" rel=\"1\"> Bild 2 vergr&ouml;&szlig;ern </a>\n<p>Thomas Tuchel gilt als akribischer Taktiker</p>\n</dd></dl>\n<p>F&uuml;r Tuchel ist das neue Engagement die bisher gr&ouml;&szlig;te Herausforderung als Coach. Schlie&szlig;lich wird von ihm erwartet, dass er den zuletzt wankenden Revierclub zur&uuml;ck in die Bundesliga-Spitze f&uuml;hrt. Unter der siebenj&auml;hrigen Regie von Klopp gewann der BVB&nbsp;zwei deutsche Meisterschaften (2011 und 2012), den DFB-Pokal (2012) und zog in das Champions-League-Finale (2013) ein. Wie popul&auml;r Klopp auch nach seinem R&uuml;cktritt in Dortmund noch immer ist, dokumentieren die Ereignisse beim 3:0 des BVB am Samstag gegen den SC Paderborn. In den letzten Minuten der Partie wurde der scheidende Coach in minutenlangen Sprechch&ouml;ren gefeiert.</p>\n</div>\n<hr />\n<p id=\"stand\">Stand: 19.04.2015, 16.00 Uhr</p>',0),(40,'<h3>Leeres Projekt.</h3>\n<p>Lorem ipsum dolor sit amet, <strong>consetetur</strong> sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolore magna aliquyam erat, sed diam voluptua. At vero eos et accusam et justo duo dolores et ea rebum. Stet clita kasd gubergren, no sea takimata sanctus est Lorem ipsum dolor sit amet. Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolore magna aliquyam erat, sed diam voluptua. At v