eit,&nbsp; ???????</li>\n<li>Kinder- und Jugendarbeit, ???????</li>\n<li>Gemeinwesenarbeit -- nein</li>\n<li>Kultur-, Spiel- und Medienp&auml;dagogik,</li>\n<li>P&auml;dagogik der Kindheit -- nein</li>\n<li>Schulsozialarbeit -- nein</li>\n<li>klinische Sozialarbeit -- nein</li>\n<li>Resozialisierung</li>\n<li>interkulturelle Soziale Arbeit ?????</li>\n</ul>\n<p>&nbsp;</p>\n<p>- sich individuell mit dem Tr&auml;ger und der Stelle auseinandersetzen (schon bei schriftlicher Bewerbung)<br />- Genau die Stelle benennen, auf die man sich bewirbt<br />- gute Vorbereitung f&uuml;r Bewerbungs-Gespr&auml;ch <br />- Klare Vorstellungen zu der angebotenen Stelle haben <br />- Wenn man ins Fettn&auml;pfchen getregen ist - ansprechen<br />- Die Bewerbungsunterlangen beim Gespr&auml;ch nochmal mitbringen<br />- Warum passt der Job zu mir?<br />- Seine St&auml;rken und Schw&auml;chen kennen <br />- Fragen vorbereiten</p>\n<p>&nbsp;</p>\n<p><strong>--&gt; Gespr&auml;ch mit J&ouml;rg am 02.02.2016:</strong></p>\n<p>- er meint, ich wolle gestalten und eine \"kleine Leitungsrolle\" nicht f&uuml;r Soz-P&auml;ds. sondern eher nachrangige Berufsgruppen w&uuml;rde gut passen \"irgendwann muss man den Schritt machen\". <br />- zu St&auml;rken nannte er Wahrnehmung / Schw&auml;che sei strategisch unkluges Verhalten - wollen wir zwei Coaching-Treffen f&uuml;r machen. <br />- Gehalt ist verhandlungssachen - inzwischen kann man das in Vorstellungsgespr&auml;ch machen, wenn es nicht in der Stellenanzeige genannt ist. <br />- Auch Hospitation von Einstllung ist keine Problem, in der Regel hat man sowieso ein Treffen mit dem Team, bevor es zum Vertrag kommt. <br />- Junges Team findet er f&uuml;r mich auch besser. <br />- Soll mir was &uuml;berlegen wegen Grund zum Wechsel - z.B. weniger Pendelzeit.</p>\n<p><strong>--&gt; gute Einrichtungen:</strong><br /><span style=\"color: #ff0000;\">- Op de Wisch - demn&auml;chst STelle frei / Aufsuchende Arbeit / freie Zeitgestaltung /&nbsp;Fr. Paul, Team Nord</span><br />- H&ouml;lderlin e.V. (Antro)<br />- PST<br />- TGJ<br />- Come in!</p>\n<p><strong>--&gt; Schlechte Einrichtungen:</strong><br />- Raues Haus<br />- Sozialarbeit und Segeln<br />- Magaretenhof</p>\n<p>---&gt; Je mehr GmbH, desto mehr spielt Geld eine Rolle</p>\n<p>&nbsp;</p>',1),(42,'<h1>Leeres Projekt.</h1>',0),(43,'<h3>Lorem ipsum dolor</h3>\n<p>Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolore magna aliquyam erat, sed diam voluptua. At vero eos et accusam et justo duo dolores et ea rebum. Stet clita kasd gubergren, no sea takimata sanctus est Lorem ipsum dolor sit amet. Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolore magna aliquyam erat, sed diam voluptua. At vero eos et accusam et justo duo dolores et ea rebum. Stet clita kasd gubergren, no sea takimata sanctus est Lorem ipsum dolor sit amet.</p>\n<p>Lorem ipsum dolor Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolore magna aliquyam erat, sed diam voluptua. At vero eos et accusam et justo duo dolores et ea rebum. Stet clita kasd gubergren, no sea takimata sanctus est Lorem ipsum dolor sit amet.</p>\n<h4><br />Sanctus est Lorem<br /> Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolore magna aliquyam erat, sed diam voluptua. At vero eos et accusam et justo duo dolores et ea rebum. Stet clita kasd gubergren, no sea takimata sanctus est Lorem ipsum dolor sit amet. Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolore magna aliquyam erat, sed diam voluptua. At vero eos et accusam et justo duo dolores et ea rebum. Stet clita kasd gubergren, no sea takimata sanctus est Lorem ipsum dolor sit amet.</h4>\n<p>Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod t