 und der &Ouml;konomie.\"</p>\n<p>\"Die neue &ouml;konomische Ordnung h&ouml;hlt das Selbstwertgef&uuml;hl nicht nur auf dem Markt aus, sie untergr&auml;bt auch die Institutionen, die Menschen traditionell vor dem Markt sch&uuml;tzten. Deshalb suchen die Menschen nach Ausgleich an den Orten, an denen sie leben: pers&ouml;nliches Ansehen an ihrem Wohnort, wenn schon nicht mehr am Arbeitsplatz, ein Gef&uuml;hl der Zusammengeh&ouml;rigkeit und Stabilit&auml;t in der Gemeinde, wie es in den gro&szlig;en, st&auml;ndig umstrukturierten und weiterverkauften Firmen nicht mehr zu finden ist.\"</p>\n<p>\"Weil aber Orte, seien sie gro&szlig; oder klein, nicht autark sind, k&ouml;nnen sie in Wirklichkeit gar nicht die sozialen Kompensationen liefern, nach denen die Menschen suchen. Und wenn sich Stadtviertel, St&auml;dte oder Nationen zu defensiven Zufluchtsorten gegen eine feindliche Welt entwickeln, dann kann es auch dazu kommen, da&szlig; sie sich Symbole des Selbstwert- und Zugeh&ouml;rigkeitsgef&uuml;hls nur noch mittels Praktiken der Ausgrenzung und Intoleranz zu verschaffen verm&ouml;gen.\"</p>\n<p>\"In der Moderne &uuml;bernehmen die Menschen die Verantwortung f&uuml;r ihr Leben, weil sie den Eindruck haben, es h&auml;nge von ihnen ab. Aber wenn die Kultur der Moderne mit ihren Prinzipien pers&ouml;nlicher Verantwortung und zielgerichteten Lebens in eine Gesellschaft ohne institutionelle Schutzr&auml;ume mitgeschleppt wird, ist nicht Stolz oder Selbstw'),(6,1,4299,'2015-01-30 15:31:09','<p>sssss</p>'),(7,6,4295,'2015-01-30 20:42:41','<p>test</p>'),(8,6,4253,'2015-01-30 20:43:34','<p>test</p>'),(9,6,4152,'2015-01-30 20:43:59','<p>test</p>'),(10,1,4332,'2015-02-03 19:31:44','<p>Obgleich personalisierte Werbung dann noch immer eine wichtige Rolle spielen wird, werden personenbezogene Daten zunehmend f&uuml;r Zwecke verwendet, die empfindlich&nbsp;in unser Leben eingreifen.</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>'),(11,9,4394,'2015-02-09 12:36:48','<p>&nbsp;</p>\n<p>\"<em><span style=\"font-family: Verdana-Italic; font-size: medium;\"><span style=\"font-family: Verdana-Italic; font-size: medium;\">F&uuml;r mich ist die aktive Lebensgestaltung der Schl&uuml;ssel zur zufriedenen Abstinenz.\"</span></span></em></p>\n<p><em><span style=\"font-family: Verdana-Italic; font-size: medium;\"><span style=\"font-family: Verdana-Italic; font-size: medium;\">\"<em><span style=\"font-family: Verdana-Italic; font-size: medium;\"><span style=\"font-family: Verdana-Italic; font-size: medium;\">Als Fazit steht f&uuml;r mich fest: Abstinenz ist etwas Lebendiges und sehr Pers&ouml;nliches, das jeder f&uuml;r sich individuell gestalten darf. Dabei gibt es kein Gut oder Schlecht, Feige oder Mutig. Wichtig ist allein die pers&ouml;nliche zufriedene Abstinenz. Den Weg dorthin und die Gestaltung liegt in meinen eigenen H&auml;nden, <strong>eine Freiheit, die mir &uuml;brigens die Abstinenz zur&uuml;ckgegeben hat.\"</strong></span></span></em></span></span></em></p>'),(12,20,4403,'2015-02-09 15:01:53','<p>\"<span style=\"font-family: Arial;\">Die Suchtmittel Alkohol oder Medikamente spielen im Leben des Abh&auml;ngigen ein wichtige, meist sogar &uuml;berragende Rolle. Sie beeinflussen seine Gef&uuml;hlslage, sein Verhalten und sein allgemeines Wohlbefinden oft mehr, als es wichtige Personen aus seiner Umgebung verm&ouml;gen. Deshalb kann man mit Fug und Recht die Entscheidung zur Abstinenz - und damit den Verlust der Droge - mit dem Verlust einer geliebten wichtigen Person vergleichen. </span></p>\n<p align=\"LEFT\">Die &uuml;blicherweise auftretende Gef&uuml;hlsreaktion auf einen Verlust hin nennt man \"Trauer\".\"</p>\n<p align=\"LEFT\">... \"<span style=\"font-family: Arial;\">In der Vergangenheit hatte der Alkohol &uuml;ber die Verluste, die er selbst verursacht hat, wieder hinweggeholfen, so dass Verlustsituationen und die dazugeh&ouml;rige Trauer ein starkes Verlangen nach Alkohol ausl&ouml;sten.\"</span></p>\n<p align=\"LEFT\"><span style=\"font-family: Arial;\">\"<span style=\"font-family: Arial;\">Das eben Geschilderte bedeutet aber zugleich, dass die Freude von Abh&auml;ngigen und Angeh&ouml;rigen dar&uuml;ber, dass die \"Abstinenz so leicht f&auml;llt\" meist verfr&uuml;ht ist. Das Leichtfallen ist n&auml;mlich bisweilen nichts anderes als ein Zeichen daf&uuml;r, dass die Entscheidung zur Abstinenz mit allen ihren Folgen noch nicht realistisch erkannt und akzeptiert worden ist.\"</span></span></p>'),(13,1,4452,'2015-02-19 12:38:37','<p>Test Test Test</p>'),(14,6,4480,'2015-02-23 13:42:09','<p align=\"LEFT\"><span style=\"font-size: medium;\">.. Im Folgenden geht es darum, einige M&ouml;glichkeiten, die eine netzwerkbezogene Perspektive f&uuml;r Beratung er&ouml;ffnet, darzustellen und in ihren Implikationen f&uuml;r die Ausgestaltung von Beratung zu analysieren. </span></p>\n<p>.. Dazu wird zun&auml;chst der Versuch unternommen, in K&uuml;rze deutlich zu machen, welche Rolle Beratung in und f&uuml;r die Soziale Arbeit spielt und welches Beratungsverst&auml;ndnis einer sozialp&auml;dagogischen Beratung unterliegt. Die Bedeutung der Netzwerkperspektive in der Beratung wird entlang von zwei &ndash; voneinander unterscheidbaren &ndash; Netzwerkformen aufgezeigt: den sozialen Netzwerken einerseits, den institutionellen Netzwerken andererseits.</p>'),(15,9,4657,'2015-04-07 22:21:12','<p>test</p>'),(16,33,4703,'2015-04-14 11:07:13','<p>sdfsdfsfscdcsdv</p>'),(17,1,4699,'2015-04-14 18:19:11','<p>test gfgfgf</p>'),(18,1,4591,'2015-04-16 17:44:31','<p>test</p>'),(19,1,4279,'2015-04-16 21:41:41','<p>sdsdsd</p>'),(20,6,4706,'2015-04-16 21:42:08','<p>sdsd</p>'),(21,1,3468,'2015-04-16 21:45:28','<p>ggf</p>'),(22,6,4702,'2015-04-16 21:46:29','<p>sdsdsd</p>'),(23,36,4719,'2015-04-16 22:29:19','<p><em>dfdfdfdfdf</em></p>'),(24,36,4693,'2015-04-16 22:29:47','<p>dfdfdf</p>'),(25,1,4710,'2015-04-16 22:30:55','<p>dfdfdf</p>'),(26,33,4609,'2015-04-17 11:40:42','<p>zsdfsdf</p>'),(27,6,4705,'2015-04-17 14:52:33','<p>test</p>'),(28,9,4723,'2015-04-19 15:52:13','<p>test</p>'),(29,16,4716,'2015-04-19 17:10:20','<p>test</p>'),(30,38,4728,'2015-04-19 17:10:41','<p>test</p>'),(31,9,4706,'2015-04-20 08:42:23','<p>test</p>'),(32,1,4716,'2015-04-22 14:39:05','<p>test</p>'),(33,1,4725,'2015-04-22 14:39:53','<p>test</p>'),(34,1,4755,'2015-04-27 09:51:21','<h2 align=\"LEFT\"><span style=\"font-family: Arial; font-size: medium;\"><span style=\"font-family: Arial; font-size: medium;\">\"Seins m</span></span><span style=\"font-family: Arial0; font-size: medium;\"><span style=\"font-family: Arial0; font-size: medium;\">&ouml;glichkeiten </span></span><span style=\"font-family: Arial; font-size: medium;\"><span style=\"font-family: Arial; font-size: medium;\">erschliessen, Wirklichkeit erschaffen, sich neu konstituieren, sich wieder </span></span>zusammensetzen nach dem Herausgefallensein aus Raum und Zeit, sich wieder <span style=\"font-family: Arial; font-size: medium;\"><span style=\"font-family: Arial; font-size: medium;\">Zusammenf</span></span><span style=\"font-family: Arial0; font-size: medium;\"><span style=\"font-family: Arial0; font-size: medium;\">&uuml;gen nach dem totalen Auseinanderbrechen der bisherigen Sicht- und Seinsweise,&nbsp;</span></span><span style=\"font-family: Arial; font-size: medium;\"><span style=\"font-family: Arial; font-size: medium;\">darum geht es nach traumatischen Ersch</span></span><span style=\"font-family: Arial0; font-size: medium;\"><span style=\"font-family: Arial0; font-size: medium;\">&uuml;tterungen.\"</span></span>&nbsp;</h2>\n<h2 align=\"LEFT\">Traumatische Erfahrungen sind wie&nbsp;ein Einbruch einer unsichtbaren Gegenwart, nicht einzuordnen in das rationale Verstehen, eine Konfrontation mit dem ganz Anderen, wie ein Hineinragen einer schrecklichen transpersonalen&nbsp; Dimension in das Menschliche.<br /><br /></h2>\n<p align=\"LEFT\"><span style=\"font-family: Arial; font-size: medium;\"><span style=\"font-family: Arial; font-size: medium;\">Es sind vor allem </span></span><span style=\"font-family: Arial+Fett0; font-size: medium;\"><span style=\"font-family: Arial+Fett0; font-size: medium;\">5 Faktoren der pers&ouml;nlichen Reifung </span></span><span style=\"font-family: Arial; font-size: medium;\"><span style=\"font-family: Arial; font-size: medium;\">nach traumatischen Erfahrungen,die in </span></span><span style=\"font-family: Arial; font-size: medium;\"><span style='),(35,34,3165,'2015-05-11 08:38:23','<h3>Nach &sect; 2 Abs. 1 SGB IX sind Menschen behindert, wenn ihre k&ouml;rperliche Funktion , geistige F&auml;higkeit oder seelische Gesundheit mit hoher Wahrscheinlichkeit l&auml;nger als 6 Monate von dem f&uuml;r das Lebensalter typischen Zustand abweichen und daher ihre Teilhabe am Leben in der Gesellschaft beeintr&auml;chtigt ist; von Behinderung bedroht sind sie dann, wenn die Beeintr&auml;chtigung zu erwarten ist.</h3>\n<h3 align=\"LEFT\">In einem Wohnheim erfahren die betroffenen Menschen Unterst&uuml;tzung in den Bereichen Wohnen, Arbeit und Freizeit mit dem Ziel einer m&ouml;glichst selbst&auml;ndigen, sinnerf&uuml;llten und suchtmittelfreien Lebensf&uuml;hrung. Strukturver&auml;nderungen in der Wirtschaft, steigende Arbeitslosigkeit und daraus resultierende Neuorientierungen im Leben &uuml;berfordern nicht selten die Anpassungskapazit&auml;ten der suchtkranken Menschen.</h3>\n<h3 align=\"LEFT\"><span style=\"font-family: BritannicEFMedium,Bold;\"><strong>Konkrete Ziele </strong></span><span style=\"font-family: Tahoma; font-size: small;\"><span style=\"font-family: Tahoma; font-size: small;\">variieren bez&uuml;glich des aufzunehmenden Personenkreises, sind aber </span></span>vor allem:</h3>\n<h3 align=\"LEFT\"><span style=\"font-family: Symbol; font-size: small;\"><span style=\"font-family: Symbol; font-size: small;\">&middot; </span></span><span style=\"font-family: Tahoma; font-size: small;\"><span style=\"font-family: Tahoma; font-size: small;\">Vorbereitung eines suchtmittelfreien Lebens<br /></span></span><span style=\"font-family: Symbol; font-size: small;\"><span style=\"font-family: Symbol; font-size: small;\">&middot; </span></span><span style=\"font-family: Tahoma; font-size: small;\"><span style=\"font-family: Tahoma; font-size: small;\">&Uuml;berwindung oder Minderung krankheitsbedingter Beeintr&auml;chtigungen, funktioneller </span></span>Einschr&auml;nkungen und Sch&auml;digungen<br /><span style=\"font-family: Symbol; font-size: small;\"><span style=\"font-family: Symbol; font-size: small;\">&middot; </span></span><span '),(36,39,4814,'2015-05-17 21:05:39','<h2>&nbsp;</h2>\n<h2>Hier kann man private Bemerkungen reinschreiben</h2>'),(37,1,4248,'2015-06-29 13:10:02','<p>&nbsp;</p>\n<p style=\"margin: 0cm 0cm 0pt;\"><span style=\"font-family: Calibri; font-size: medium;\">Die &Uuml;bergangseinrichtung Haus ELIM ist eine spezialisierte Einrichtung f&uuml;r M&auml;nner mit Abh&auml;ngigkeitserkrankungen und bietet ein differenziertes Wohn- und Betreuungsangebot in einer voll- und teilstation&auml;ren &Uuml;bergangseinrichtung an.<br /></span><span style=\"font-family: Times New Roman; font-size: medium;\"><br /></span></p>\n<p style=\"margin: 0cm 0cm 0pt;\"><span style=\"font-family: Calibri; font-size: medium;\">Das Haus ELIM besteht seit &uuml;ber 33 Jahren und ist mittlerweile fest in das regionale psychiatrische Versorgungssystem integriert. </span></p>\n<p>&nbsp;</p>\n<p style=\"margin: 0cm 0cm 0pt;\"><span style=\"font-family: Calibri; font-size: medium;\">Die vollstation&auml;re Einrichtung in Wilster war eine der ersten Einrichtungen in Schleswig-Holstein - mit einem speziellen Betreuungsangebot f&uuml;r Personen mit Doppeldiagnosen (z.B. Sucht und Psychose).</span><span style=\"font-family: Times New Roman; font-size: medium;\"><br /></span></p>\n<p>&nbsp;</p>\n<p style=\"margin: 0cm 0cm 0pt;\"><span style=\"font-family: Calibri; font-size: medium;\">Wir verf&uuml;gen &uuml;ber 25 Pl&auml;tze in 23 Zimmern. Die Einrichtung verteilt sich auf vier benachbarte Geb&auml;ude, mit einer Gesamtgrundst&uuml;cksfl&auml;che von &uuml;ber 4000 qm.</span><span style=\"font-family: Calibri; font-size: medium;\">&nbsp;</span></p>\n<p>&nbsp;</p>\n<p style=\"margin: 0cm 0cm 0pt;\"><span style=\"font-family: Calibri; font-size: medium;\">Die Einrichtung liegt in der Kleinstadt Wilster (4.500 Einwohner), die sich an der Bahnlinie Hamburg-Sylt befindet. Wilster (Kreis Steinburg) liegt in Schleswig-Holstein und geh&ouml;rt zur Metropolregion Hamburg. </span></p>\n<p>&nbsp;</p>\n<p style=\"margin: 0cm 0cm 0pt;\"><span style=\"font-family: Calibri; font-size: medium;\">Die zentrale Verkehrsanbindung (ZOB) ist in direkter Lage zu der Einrichtung vorhanden. Diese f&uuml;hrt nach Itzehoe (10 km), Brunsb&uuml;ttel</span></p>\n<p>&nbsp;'),(38,16,5056,'2015-08-06 12:52:50','<p>Doch das Tempo und die Tiefe, mit denen die Digitalisierung bekannte Muster hinwegfegt, wirft neue grundlegende Fragen auf: Wenn mein intelligenter Musikdienst auf dem Smartphone von Tag zu Tag besser meinen Geschmack trifft, wie schnell kann ein solches Programm dann lernen, meinen B&uuml;rojob zu erledigen?</p>\n<p>Wird es, wie ein exponierter Vertreter der Internetszene prophezeit, k&uuml;nftig nur noch zwei Gruppen von Arbeitskr&auml;ften geben: Diejenigen, die Computern sagen, was sie tun sollen - und jene, die von Computern gesagt bekommen, was sie tun sollen?</p>'),(39,44,3789,'2015-08-31 09:02:29','<p>In diesem Zusammenhang ist es f&uuml;r Fachkr&auml;fte der Sozialen Arbeit entscheidend, das eigene Handeln anhand von Methoden kommunizierbar und theoretisch begr&uuml;ndbar zu machen, d. h. eine eigene Position im Kontext einer multiprofessionellen Arbeit zu entwickeln, auf deren Basis notwendige Impulse von Aussen souver&auml;n aufgenommen werden k&ouml;nnen. nn</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>'),(40,45,5167,'2015-08-31 16:10:13','<p>ff</p>');
