g gestellt werden.</p>\n<p><strong>15.01.2015:</strong> R&ouml;ngenaufnahme gemacht. Entz&uuml;ndungsm&auml;&szlig;ig ist erstmal nicht so viel / nichts zu sehen. Es sieht sehr danach aus, als m&uuml;sste der Zahn raus, weil die Tasche sehr gro&szlig; ist und sich auch nicht zur&uuml;ckentwickeln kann - deshalb kommen immer Bakterien rein und der Zahn tut weh. Der Zahnarzt kann mir nichts was raten. <strong>Es gibt unterschiedliche Optionen bzw Entscheidungen:</strong><br />- 3. Meinung von Sepezialisten einholen<br />- Zahn raus<br />- Antibiotika<br />- Antrag bei KK und Parad.-Behandlung<br />- Br&uuml;cke oder Implantat</p>\n<p>--&gt; Wenn der Zahn raus kommt, gibt es keine Frist, bis was neues rein muss.</p>','2014-12-23 11:38:31','2015-05-07 11:38:31',8),(26,1,'1.5 Dietmars Sachen / NOTHilfe e.V.','<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>- Konto bei Ebay l&ouml;schen<br />- schnelle Festplatte</p>\n<h2><span style=\"color: #008000;\">-- Ostern: Antivirus f&uuml;r Dietmar</span></h2>\n<p>&nbsp;</p>\n<p>mozilo: admin / lsd495rYdkf</p>\n<h1>Backup von der Seite machen</h1>\n<p>&nbsp;</p>','2014-12-24 21:23:54','2015-04-23 21:23:54',9),(29,1,'1.4 Musik','<h2>&nbsp;</h2>\n<h2>&nbsp;&nbsp;&nbsp; - The Chemical Brothers<br />&nbsp;&nbsp;&nbsp; - couldplay<br />&nbsp;&nbsp;&nbsp; - Madonna<br />&nbsp;&nbsp;&nbsp; - Marius M&uuml;ller Westernhagen (Live)<br />&nbsp;&nbsp;&nbsp; - Rocko Schamoni Die Vergessenen<br />&nbsp;&nbsp;&nbsp; - <span class=\"artist\"><a href=\"http://www.lastfm.de/music/Deichkind\">Deichkind<br />&nbsp;&nbsp;&nbsp; - </a></span>Alice in Chains<br />&nbsp;&nbsp;&nbsp; - U2</h2>','2014-12-26 09:26:42','2015-09-06 09:26:42',6),(32,16,'Test 1.1','','2015-01-09 21:21:31','2015-05-14 21:21:31',5),(33,16,'Test 2','','2015-01-09 22:44:18','2015-01-09 22:44:18',8),(34,16,'Test 3','','2015-01-09 08:59:26','2015-01-09 08:59:26',7),(36,9,'Test','<p>gf fgfgfgfg fg fg fgfg fg fgf gf g</p>','2015-01-14 21:20:14','2015-04-06 21:20:14',4),(37,9,'Test 2','<p>sdfsdfsdfs