einen Datensatz mehr anzeigen (damit die H&ouml;he der Seite ungef&auml;hr gleich bleibt).<br />- Bei der Suche: Beim Eingeben von Tags anzeigen wieviele Datens&auml;tze es gibt mit dem Tag (Dropdownliste)<br /><strong>- In den Listenansichten nach den oberen Kategorieen sortieren.</strong> <br /><strong>- Projekt: mehr Einstellungsm&ouml;glichkeiten von mytiny</strong><br />- ein einpflegen eines Datensatzes muss ein TAG zugewiesen werden, damit man das Popup schlie&szlig;en kann - sonst Fehlermeldung: \"Bitte mindestens ein Tag zuweisen, damit der Datensatz auch gefunden werden kann\". Und verhindern, dass das letzte TAG gel&ouml;scht wird.<br /><strong><span style=\"color: #000000;\"><span style=\"text-decoration: none;\"><span style=\"font-weight: normal;\">- MinusTAGs zulassen? - z.B. Vertrauen (-5)<br />- </span></span></span></strong>Some browsers make small dots to active text fields (eg when it writes something in it) Can you turn that off ? (I tested vitoop in many browser - and it looks good :-) Which browsers? Can you provide name and version of browser and on which page I can look at this behavior?<br /><strong>- ToDo:</strong> Button rechts, ein kleines Icon auf der rechten Seite einf&uuml;gen, bei Klick werden UnterButton angezeigt, die die selbe Funktion haben wie die \"OberButton\".<br /><strong>- ToDo:</strong> Gemeinsames Bearbeitungsrecht f&uuml;r ToDo&acute;s einrichten.<br />- <strong>ToDo</strong>: im Speichern Button anhaken k&ouml;nnen, ob immer automatisch gespeichert werden soll?<br />- <strong>ToDo:</strong> Erinnerungsfunktion einrichten<br />- ToDo: Einzelne Punkte farbig markieren k&ouml;nnen (rechte Seite ein Icon einf&uuml;gen)<br /><br />__________________________________________________________________________</p>\n<p style=\"margin-bottom: 0cm; line-height: 100%;\"><strong><span style=\"color: #000000;\"><span style=\"text-decoration: none;\">Reduzieren von Tags (oder Ta</span></span></strong><strong><span style=\"color: #000000;\"><span style=\"text-decoration: none;\">ganzahl)</span></span></strong></p>\n<p style=\"margin-bottom: 0cm; font-weight: normal; line-height: 100%; text-decoration: none;\"><span style=\"color: #000000;\">bei den Plus- und Minusbutton wird rechts vom Zeichen die Zahl in Klammern (in grau) eingeblendet f&uuml;r die Anzahl der Tags, die ein User noch zuweisen, oder l&ouml;schen kann</span></p>\n<p style=\"margin-bottom: 0cm; font-weight: normal; line-height: 100%; text-decoration: none;\"><span style=\"color: #000000;\">- MUST: Wenn der Lampe-Button aktiv ist, wird bei den zugewiesenen Tags nicht nur angezeigt wie viele zugewiesen wurden, sondern auch wie viele gel&ouml;scht wurden Bsp: (+17/-4).<br />__________________________________________________________________________</span></p>\n<p style=\"margin-bottom: 0cm; line-height: 100%; text-decoration: none;\"><span style=\"color: #000000;\"><strong>Schon vorhandene URL: Fehlermeldung anzeigen, bei lostfocus</strong><br /><span style=\"font-weight: normal;\">- </span><span style=\"font-weight: normal;\">Neu anlegen eines Datensatzes auch verweigern, wenn die URL von einem schon gespeicherten Textlink als z.B. Pdf gespeichert werden soll</span></span></p>\n<p style=\"margin-bottom: 0cm; line-height: 100%; text-decoration: none;\"><span style=\"color: #000000;\"><span style=\"font-weight: normal;\">__________________________________________________________________________</span></span></p>\n<h3>&nbsp;Verschiedene:</h3>\n<p lang=\"zxx\" style=\"margin-bottom: 0cm; font-weight: normal; text-decoration: none;\"><span style=\"color: #000000;\">- <strong>Blacklist</strong>: Liste von &bdquo;nicht erlaubten Worten&ldquo; damit User in Bezug auf Stichworte, Kommentare usw. keinen Schei&szlig; eingeben k&ouml;nnen. </span></p>\n<p lang=\"zxx\" style=\"margin-bottom: 0cm; text-decoration: none;\"><span style=\"color: #000000;\"><strong>- </strong><span style=\"font-weight: normal;\"><strong>Beknackte User:</strong> Wenn sich ein User als Troll rausstellt &ndash; One-Klick-L&ouml;schung von User und allem was er jemals eingegeben hat.</span></span></p>\n<p lang=\"zxx\" style=\"margin-bottom: 0cm; text-decoration: none;\"><span style=\"color: #000000;\"><strong>- Detailsuche: </strong><span style=\"font-weight: normal;\">Eine Suche im PopupFenster, wo man nach Titelworten, Autor, Seitenzahl, Datum suchen kann</span></span></p>\n<p><strong><span style=\"color: #000000;\"><span style=\"text-decoration: none;\">- </span></span><span style=\"color: #000000;\"><span style=\"text-decoration: none;\">Userabstimmung</span></span><span style=\"color: #000000;\"><span style=\"text-decoration: none;\">: </span></span></strong><span style=\"color: #000000;\"><span style=\"text-decoration: none;\"><span style=\"font-weight: normal;\">User k&ouml;nnen die Weitere Entwicklung beeinflussen: Sie k&ouml;nnen neue Features vorschlagen und abstimmen.</span></span></span>&nbsp;</p>\n<p lang=\"zxx\" style=\"margin-bottom: 0cm; text-decoration: none;\"><strong><span style=\"color: #000000;\">- Extrafeld f&uuml;r St&auml;dte??</span></strong></p>\n<p lang=\"zxx\" style=\"margin-bottom: 0cm; text-decoration: none;\"><span style=\"color: #000000;\"><span style=\"font-weight: normal;\">- <strong>Internationalisierung</strong></span></span></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p lang=\"zxx\" style=\"margin-bottom: 0cm; text-decoration: none;\"><span style=\"color: #000000;\"><strong>- </strong><span style=\"font-weight: normal;\"><strong>Bereich Film:</strong> Beschreibung des Films, L&auml;nge, Regie usw. Trailer im Frame abspielen / Film selbst nur in der Lokalen </span><span style=\"font-weight: normal;\">V</span><span style=\"font-weight: normal;\">ersion. </span></span></p>\n<p>&nbsp;</p>','2015-01-16 23:15:48','2015-08-29 23:15:48',12),(62,1,'9.9 task-7 / Lexikon','<h3>3.1 task-7 / Lexikon <span style=\"color: #000000;\"><strong>mit Wikipedia</strong></span></h3>\n<p>- Wenn ein vitoop-Nutzer einen Lexikon-Eintrag anlegt, wird der betreffende Wikipedia-Artikel (ohne Bilder oder Zusatzinformationen) per API live bezogen und in der vitoop-Datenbank gespeichert (nur der Teil, der geraucht wird).<br />- Auf vitoop wird nur er obere Teil des Wikipedia-Artikels dargestellt (ca. die ersten 15 Zeilen ohne Inhaltsangabe), mit korrekter Quellenangabe und Link wie auf der Seite https://de.wikipedia.org/wiki/Wikipedia:Weiternutzung#Weiternutzung_von_Text beschrieben.<br />- Wenn ein vitoop-Nutzer einen gespeicherten Artikel wieder aufrufen m&ouml;chte wird programmintern gepr&uuml;ft, wann der letzte Abgleich mit dem Wikipedia-Artikel stattfand. Innerhalb des Zeitraums von drei Monaten wird direkt der auf vitoop gespeicherte Artikel dargestellt. Wenn der Zeitraum drei Monate &uuml;bersteigt, wird programmatisch gepr&uuml;ft, ob es auf Wikipedia eine aktullere Version gibt - wenn ja wird der Artikel ersetzt und auf vitoop gespeichert.</p>\n<p style=\"margin-bottom: 0cm; font-weight: normal; line-height: 100%; text-decoration: none;\"><span style=\"color: #000000;\">- Wiki-Datenbank auf dem eigenen Server (Umschaltm&ouml;glichkeit bei eigenen Server)<br />- ohne Bilder, ohne Links oder Schnickschnack<br />- einfachen Text (mit CSS) in Textfeld einblenden (ohne Inhaltsverzeichnis)<br />- The hoster domainfactory sagt, dass die Gr&ouml;&szlig;e der mysql Datenbank nicht begrenzt ist (bzw. Joachim sagt das)<br /></span></p>\n<p style=\"margin-bottom: 0cm; font-weight: normal; line-height: 100%; text-decoration: none;\"><span style=\"color: #000000;\">- mit Quelle von Wikipedia, so wie die das wollen<br />- Textfeld kann nicht gescrollt werden, nach unten Text ausblenden</span></p>\n<p style=\"margin-bottom: 0cm; font-weight: normal; line-height: 100%; text-decoration: none;\"><span style=\"color: #000000;\">- In der selben Ansicht sollte es noch die M&ouml;glichkeit geben, Tags zu verkn&uuml;pfen, und eine Verkn&uuml;pfung zu anderen Lexikonartikeln und zu eigenen Projekten anzulegen.<br /><br /></span></p>\n<p style=\"margin-bottom: 0cm; line-height: 100%; text-decoration: none;\"><span style=\"color: #000000;\"><strong>- </strong><span style=\"font-weight: normal;\"><strong>RR bei Lexikon</strong>: wenn man sich in einem Lexikon-</span><span style=\"font-weight: normal;\">A</span><span style=\"font-weight: normal;\">rtikel die zugewiesenen Datens&auml;tze anschaut, z.B. die pdfs bei \"Soziale Arbeit\" soll der RR von oben (gr&ouml;&szlig;te Anzahl) nach unten (geringste Anzahl) sortiert werden.</span></span></p>\n<p>- API-Zugriffe z&auml;hlen mit Datum und speichern</p>\n<p><br /><br /><br /><br /><br /><br /></p>','2015-01-16 11:00:19','2015-08-08 11:00:19',15),(65,1,'9.0 task-? / Projekt','<p lang=\"zxx\" style=\"margin-bottom: 0cm;\"><span style=\"color: #000000;\"><span style=\"text-decoration: none;\"><br />- </span></span><span style=\"color: #000000;\"><span style=\"text-decoration: none;\">zugewiesene Datens&auml;tze auch wieder vom Projekt l&ouml;sen<br />- </span></span><span style=\"color: #000000;\"><span style=\"text-decoration: none;\">zugewiesene Datens&auml;tze sortieren (1.1, 1.2, 1.3 usw. Dann Zwischen&uuml;berschriften einbinden k&ouml;nnen wo es dann weitergeht mit 2.1, 2.2, 2.3 usw.)<br /><br /></span></span><strong><span style=\"color: #000000;\"><span style=\"text-decoration: none;\"><span style=\"color: #000000;\">- Impressum f&uuml;r Projektmeister?</span></span></span></strong></p>\n<p lang=\"zxx\" style=\"margin-bottom: 0cm; text-decoration: none;\"><strong><span style=\"color: #000000;\">- CMS einrichten mit ..</span></strong><br /><span style=\"color: #000000;\">- mehrere Seiten mit Navigation<br />- Twitter einbinden<br />- Newsletter<br /> - Wiki<br />- Darstellung von Statistik z.B. Tortenmodel, \"Fieberkurfe\", Balkenmodell<br />- Einbinden von FreeMind?<br />- ohne Anmeldung auf vitoop<br /></span></p>\n<ul>\n<li><span style=\"color: #000000;\">Projekt-Admin kann in einem extra Confic-Reiter entscheiden welche Reiter bei seinem Projekt sichtbar sind (vielleicht hat ein Projekt z.B. einfach keine Adressen)</span></li>\n</ul>\n<ul>\n<li><span style=\"color: #000000;\">Reiter wo alle Projektmitglieder angezeigt werden und sich gegenseitig kontaktieren k&ouml;nnen</span></li>\n</ul>\n<p lang=\"zxx\" style=\"margin-bottom: 0cm; text-decoration: none;\"><span style=\"color: #000000;\"><br /><strong><span style=\"color: #ff0000;\">--&gt; Projekt soll eine M&ouml;glichkeit sein f&uuml;r mehrere Leute sich schnell und unkompliziert koordinieren zu k&ouml;nnen mit einem gemeinsamen Schreibbord (schwarzes Brett), Emailverteiler, Passwortgesch&uuml;tzer Bereich, Dateien zum downloaden, Nachrichtenorgan (z.B. Twitter), </span></strong><br /></span></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>','2015-01-16 11:04:45','2015-08-08 11:04:45',13),(67,1,'1.01 Allgemein','<p>&nbsp;</p>\n<h3>&nbsp;&nbsp;&nbsp; </h3>\n<h3><span style=\"color: #ff0000;\"><span style=\"color: #000000;\"><br /><span style=\"color: #000000;\"><span style=\"color: #ff0000;\">&nbsp;&nbsp;&nbsp; - Fra anrufen&nbsp;</span><br />&nbsp;&nbsp;&nbsp; - B&uuml;cherei HH<br />&nbsp;&nbsp;&nbsp; - Termin bei Verbrauchertrentrale weg Rente<br />&nbsp;&nbsp;&nbsp; - Serie: \"1992\"<br /></span></span></span></h3>\n<p><span style=\"color: #ff0000;\"><span style=\"color: #000000;\"><span style=\"color: #000000;\">&nbsp;</span></span></span></p>\n<p>&nbsp;</p>\n<p><span style=\"color: #ff0000;\"><span style=\"color: #000000;\"><span style=\"color: #000000;\">---------------&gt; Raum einfordern &lt;-------------------------------</span></span></span></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><span style=\"color: #ff0000;\"><span style=\"color: #000000;\"><span style=\"color: #000000;\"><br />---&gt; langfriste Entwicklung mit A. <br /><br /><br /></span></span><br /></span></p>','2015-01-16 21:01:06','2015-08-28 21:01:06',1),(69,16,'Test','<h2><br /