enn es im Moment gut l&auml;uft \"das was da passiert wird nicht aufh&ouml;ren\" Er sieht Ute und Hilke dabei als die treibendne Kr&auml;fte. Die m&ouml;chten keine Ver&auml;nderungen und keine Entwicklung!</p>\n<h3>Gespr&auml;ch mit J&ouml;rg Rainals am 27.05.2015:</h3>\n<p>Ich werden das Team nicht &auml;ndern k&ouml;nnen. Joachim hat nicht mehr lange bis zur Rente, Hilke ist hin und wieder nicht so richtig stabil und Ute ist schon lange dabei und&nbsp;wird ihre Verhaltensweise nicht mehr &auml;ndern. Das Team der STWG ist auch keine Team im eigentlichen Sinn, sondern eher eine Gruppe, die sich miteinander abstimmt, grunds&auml;tzlich sind wir Einzelk&auml;mpfer. <br /><br />Wenn ich so weitermache wie bisher werde ich mich dabei aufreiben. Wenn jemand bei mir auf einen bestimmten Knopf dr&uuml;ckt, gehe ich beinahe automatisch in eine Rechtvertigungs- und Verteidigungshalten, argumentiere, benenne Beispiele und beschreibe und begr&uuml;nde mein Verhalten. Die anderen lehnen sich tendentiell zur&uuml;ck und lassen mich rudern. Wenn ich damit durch bin haben sie es nicht vertstanden oder bleiben trotzdem bei ihrer Meinung. Das kann einige Runden so gehen, dabei findet eine mehr oder weniger offensichtliche Eskalation statt. Grunds&auml;tzlich geht es dabei nicht um Argumente, sondern um Rollen, Rechte, Macht und Politk.</p>\n<p style=\"padding-left: 30px;\">Um mich in der Teamkonstelation nicht auzureiben und nicht krank zu werden r&auml;t er mir zu folgendem Verhalten: <br /><br />1. Im Team und bei der Arbeit gibt es keine Anerkennung oder Wertsch&auml;tzung, das muss aus dem privaten Bereich kommen (es ist Kultur bei der th. dass das so ist). <br /><br />2. Statt in den Besprechungen selbst zu rudern, ist es eine gute Alternative:<br />2.1&nbsp;Vertagen: \"Ja, ich hab es geh&ouml;rt und&nbsp;werde dr&uuml;ber nachdenken\" Oftmals werden die Themen nie wieder angesprochen. &nbsp;<em>Mal sehen, bestimmte Themen treten immer wieder auf.</em><br />2.2 \"Dumm stellen\" im Sinne von \"Hab nicht nicht verstanden\" der Effekt ist, dass die anderen rudern und nicht ich. Auch die Frage \"Wie h&auml;ttest du das gemacht?\" dient diesem Zweck. Oder die Feststellung \"Ich war in der Situation (du nicht) und habe das entschieden.\" (wichtig ist -&gt; nicht rechtfertigen!)<br />2.3 Bedienen: Egal ob es gerecht ist oder nicht - den anderen ihre Privilegien lassen, frei nach dem Motto \"Du hast Recht - ich hab meine Ruhe\" <em>.. das haben wir kontrovers diskutiert.</em></p>\n<p><br />Am Anfang des Gespr&auml;chs und zwischendurch hat J&ouml;rg beschrieben, dass in Hamburg und Umgebung viele Sozialp&auml;dagogen gesucht werden und mir ein bisschen auf den Zahn gef&uuml;hlt wie es mit Karriereplanung aussieht - kein Plan!</p>\n<p>&nbsp;</p>\n<p>---&gt; Sprache ist das einzige Instrument, das wir haben, wir sollten das nicht entwerten.</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>','2015-05-27 09:16:32','2016-02-03 09:16:32',10),(120,1,'0002 vitoop / neu','<h5><span style=\"color: #ff6600;\">Bei den neuen tasks immer beschreiben was schon funktioniert und wie es funktioniert&nbsp;<br /></span><span style=\"color: #ff0000;\">----&gt; Backup machen</span><br />--&gt; Danke f&uuml;r das Angebot mit dem GUI-Designer</h5>\n<p><span style=\"color: #008000;\"><strong>--&gt; \"Informationen sortieren\"</strong></span></p>\n<p>______________________________________________________________<br /><br />&nbsp;Really, two months ago I planned to remake all Vitoop in Angular (because there is many works on Vitoop with JavaScript - popups, confirmations and other stuffs - and because of old architecture of Vitoop - there is hard to make changes now). If you remember - I\'m using Angular in some places of Vitoop (for example, in ToDO list or Project editing), but it will be good, if all Vitoop will be written in Angular. But, maybe later)) Because I haven\'t much time now for this)<br />______________________________________________________________</p>\n<p><span style=\"color: #0000ff;\">Fragen: </span><br /><span style=\"color: #0000ff;\">- einbinden von Bib\'s ohne Inernet!<br />- Serverpaket zum download anbieten !!?<br /></span></p>\n<p><span style=\"color: #000000;\">W&auml;hrend die Suche l&auml;uft - Werbung einblenden:<br />Kaufen! Kaufen! Kaufen! \"Wir m&uuml;ssen alle ganz dringend noch viel mehr kaufen. Damit wir noch mehr sparen.\"</span></p>\n<h4><span style=\"color: #ff0000;\">Kleinigkeiten:</span> <br /><br />(Usermanagement: PW schon eingetragen (nur bei user cookie?))<br />-- Bei Button \"Tags\" im Footer - Seite so gestalten, dass die Tabelle in der gew&ouml;hnlichen Seitenh&ouml;he aufgemacht wird und die Liste in einer festen H&ouml;he scrollbar ist (mit abwechselnden Farben).<br />- Bei Projekt: oben in der Seite Elevatonpich per ajax anzeigen k&ouml;nnen.</h4>\n<h4 style=\"word-wrap: break-word;\">-----------&gt; kleine Kleinigkeiten &lt;---------------------<br />- gr&uuml;nen Button einsetzen (Header und Popup) und Notizen als Popup.<br />- ToDo-Punkte einf&auml;rben und Erinnerungsfunktion<br />- Projekte beobachten k&ouml;nnen (Haken bei P) und Dropdownliste (im Footer)<br /><br /></h4>\n<h4 style=\"word-wrap: break-word;\">- Bedienungsanleitung f&uuml;r Projekt<br /><br /><span style=\"color: #ff0000;\">Gr&ouml;&szlig;ere Sachen:</span> <br /><span style=\"color: #339966;\"><span style=\"color: #000000;\">- Bearbeiten von TAGs in einer Liste f&uuml;r User David<br /><span style=\"color: #ff0000;\">- Kommentar in Popup: David kann alle bearbeiten oder einzelne l&ouml;schen / bisschen aufh&uuml;pschen&nbsp;</span><br />- Wenn sich bei einem Datensatz was ge&auml;ndert hat kann man \"Mail schicken\" anklicken&nbsp;</span></span><br /><span style=\"color: #000000;\">- Verbinden von Bewertung und Kommentare (K. bea. und l&ouml;schen k&ouml;nnen)</span><br />- \"gelesen\" Option, oder einf&auml;rben ??<br /><span style=\"color: #ff0000;\">- User-Management f&uuml;r User \"David\" (User sperren, l&ouml;schen, Kommentar, ..)</span><br /><br />This task is ready. About problem with Internet lexicon - problem was if wiki article had some categories. I remove checking of categories and test it - everything is okay. But if you find some bugs with lexicons - write to me, please.</h4>\n<p>&nbsp;</p>\n<p>&nbsp;</p>','2015-07-09 21:47:41','2016-02-27 21:47:41',1),(121,44,'punkt 1','<h3><br />Hallo Hallo Hallo</h3>\n<h3>Hallo Hallo Hallo</h3>\n<h3>Hallo Hallo Hallo</h3>\n<h3><span style=\"color: #ff0000;\">Hallo Hallo Hallo</span></h3>\n<h3>Hallo Hallo Hallo</h3>\n<h3>&nbsp;</h3>','2015-07-14 21:32:25','2015-07-15 21:32:25',0),(122,44,'punkt 2','','2015-07-15 21:30:50','2015-07-15 21:30:50',1),(123,44,'punkt 3','','2015-07-15 21:31:04','2015-07-15 21:31:04',2),(124,44,'punkt 4','','2015-07-15 21:31:17','2015-07-15 21:31:17',3),(125,44,'punkt 5','','2015-07-15 21:31:46','2015-07-15 21:31:46',4),(126,48,'Hallo','','2015-07-26 22:22:36','2015-07-26 22:22:36',0),(127,48,'Hallo 2','','2015-07-26 22:22:56','2015-07-26 22:22:56',1),(128,27,'test','','2015-08-02 16:57:42','2015-08-02 16:57:42',0),(129,27,'test 2','','2015-08-02 16:57:51','2015-08-02 16:57:51',1),(130,1,'Stichworte','<p><br />- Sozialer Frieden<br />- Dezentralisierung <br />- Peer Education<br />- Nonprofit<br />- Public Relations<br />- Fehlerkultur<br />- Prekariat <br />- Medienwissenschaft<br />- schenk&ouml;konomie<br />- Funraising<br />- Soziale Arbeit Belastung<br />- Wohnprjekt Hamburg<br />- Bewerbung<br />- Web of Trust<br />- Gewissen<br />- Gruppe<br />- Selbstsicherheit<br />-- Unschuldsvermutung<br />- MPU<br />- Zukunft<br />- Supervision<br />- Zeitungen / Zeitschriften<br />- Inkasso<br />- Reputation<br />- Bewerbung <br />- Autorit&auml;t<br />- Petitionen <br />- emdr Trauma<br />- Machtkonzentration<br />- Politikvertrossenheit/Demokratie<br />- rfid<br />- zwei Hirnhelften<br /><br /><br />Spiegel:<br /><br />- \"Gef&auml;hrlichkeit ist ein Konstrukt\"<br />- Die Kultur des Weniger<br />- \"Sie haben