ww.navionics.com/de</p>\n<p>&nbsp;</p>\n<h3 class=\"title icon\">[PHP] Entfernung zweier Postleitzahlen (cachen ist gut)</h3>\n<p>http://www.computerbase.de/forum/showthread.php?t=1173600<br />http://www.1stwebdesigner.com/distance-finder-google-maps-api/<br />http://download.geonames.org/<br />http://www.vektorkneter.de/postleitzahl-umkreissuche-mit-php-und-opengeodb/</p>\n<h3>Statistisches Bundesamt API:</h3>\n<p>https://www-genesis.destatis.de/genesis/online?Menu=Webservice<br /><br /></p>\n<h3><strong>Allgemeine API\'s:</strong></h3>\n<p><strong>- geographische Lage von der bestimmten IP-Adresse</strong> <br />http://www.wipmania.com/</p>','2015-08-08 17:56:33','2015-08-08 17:56:33',14),(133,1,'2 Conky','<pre class=\"notranslate\"><br />- https://wiki.ubuntuusers.de/Conky<br />- https://help.ubuntu.com/community/SettingUpConky<br />- http://www.gtkdb.de/index_34_1271.html<br />- http://ubuntuforums.org/showthread.php?t=1771033</pre>\n<p>STRG + H = versteckte Dateien ein- und ausblenden</p>\n<p>Neustard: killall -SIGUSR1 conky</p>\n<p>----------------------------------------------------------------------------------------------------</p>\n<p><br />sudo apt-get install lm-sensors <br />http://de.wikihow.com/Conky-konfigurieren</p>\n<pre class=\"notranslate\">sudo apt-get install conky-all <br /><br />Zun&auml;chst sollte eine (versteckte) Konfigurationsdatei .conkyrc <br />im Homeverzeichnis des Benutzers erstellt werden.[2] Hierzu kann <br />als Ausgangspunkt die System-weite Konfigurationsdatei <br /><strong>/etc/conky/conky.conf</strong> kopiert werden.<br /><br />conky stoppen: <span style=\"color: #000000; font-family: Ubuntubeta, Ubuntu, \'Bitstream Vera Sans\', \'DejaVu Sans\', Tahoma, sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 15.99px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; display: inline !important; float: none; background-color: #ebece4;\">sudo killall conky</span><br /><br /><br /><strong>Configuration:</strong> <br />- http://conky.sourceforge.net/config_settings.html<br />- http://de.wikihow.com/Conky-konfigurieren<br />- https://wiki.ubuntuusers.de/Conky<br />- https://wiki.archlinux.de/title/Conky<br /><br /><strong>Themen:</strong> <br />- http://nmunson.com/2011/03/conky-setup-on-linux/<br />- http://www.deviantart.com/browse/all/?section=&amp;global=1&amp;q=conky<br />- http://gnome-look.org/content/search.php?xsortmode=new&amp;search=1&amp;type=0&amp;user=&amp;text=Conky&amp;sort=0&amp;scorefilter=0&amp;license=99&amp;page=0<br /><br />Conky automatisch starten: <br /><br />1.)Einfach: \"sh -c \"sleep 10; conky;\" als Befehl in die <br />Startprogrammeinstellungen eingeben. <br /><br />2.) in das User-Hauptverzeichnis eine Datei anlegen und in <br />\"Eingenschaften\" die Datei ausf&uuml;hrbar machen. Dann in den <br />Startprogrammeinstllungen (Autostart) auf die Datei verweisen. <br /><br />Inhalt Datei \"autostart\"<br /><br />#!/bin/bash<br />killall conky &amp;<br />sleep 10 &amp;&amp; conky -c ~/.conkyrc1 &amp;<br />sleep 10 &amp;&amp; conky -c ~/.conkyrc2 &amp;</pre>\n<p style=\"margin: 0.4em 0px 0.5em; color: #222222; font-family: sans-serif; font-size: 12.7px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 19.05px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;\">In beiden Konfigurationsdateien (.conkyrc1 und .conkyrc2) kann v&ouml;llig unabh&auml;ngig voneinander eine Konfiguration erstellt werden.</p>\n<pre class=\"notranslate\"><br /><br /></pre>','2015-08-08 17:05:47','2016-01-13 17:05:47',8),(134,47,'test','','2015-08-12 08:12:04','2015-08-12 08:12:04',1),(135,47,'test 3','<p>sdfgfdsfdsg</p>','2015-08-12 08:33:06','2015-08-12 08:33:06',0),(136,47,'hallo','<p>asd fdsf sda dsf dsf</p>','2015-08-12 08:33:25','2015-08-12 08:33:25',2),(137,1,'++ linux terminal','<p><br />- sudo apt-get install tor-browser<br />- root Password geben: sudo passwd root (sonst Sicherheits-Prob.)<br /><br /><strong>Offene Fragen:</strong><br />- Verschieben von ganzen Verzeichnissen<br />- Sicheres L&ouml;schen (auf hdd und ssd) <br /><br />&nbsp;</p>\n<h3>Befehle:</h3>\n<p><strong>sudo ap-get install PROG</strong> (Programm wird installiert, wenn man den Anfang eines Programms eingibt und TAB dr&uuml;ckt, werden Progs angezeigt, die so anfangen)<br /><br /><strong>cd /home&nbsp;&nbsp;&nbsp;</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (wechsel ins Home-Verzeichnis)<br /><br /></p>\n<p><strong><span style=\"color: #ff0000;\">befehl</span> --help</strong> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; (zeigt optionen an)<br /><strong>man <span style=\"color: #ff0000;\">befehl&nbsp;</span></strong>&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; (zeigt doku an - mit q kommt man wieder raus)<br /><strong>whatis <span style=\"color: #ff0000;\">befehl &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></strong><span style=\"color: #ff0000;\"><span style=\"color: #000000;\">(zeigt die Kurzbeschreibung des Befehls)</span></span><br /><br /></p>\n<p><strong>ls -a&nbsp;</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; (Verzeichnis anzeigen mit versteckten Ordnern)<br /><strong>ls -c&nbsp;&nbsp;</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (Verzeichnis anzeigen mit Ordnern und Dateien)<br /><strong>ls -C&nbsp;</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (Verzeichnis mit O und Dateien in Liste)<br /><br /><strong>sudo -s&nbsp;&nbsp;&nbsp;</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (root-Shell &ouml;ffnen / exit = schlie&szlig;en)</p>\n<p><strong>mkdir \"<span style=\"color: #ff0000;\">Neuer Ordner</span>\"</strong> (erstellt einen neuen Ordner, \"xx\" nur weil 2 Worte)</p>\n<p><strong>touch <span style=\"color: #ff0000;\">Datei</span>&nbsp;&nbsp;&nbsp;&nbsp;</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (erstellt eine Datei im Verzeichnis)</p>\n<p><strong>rm <span style=\"color: #ff0000;\">Datei</span>&nbsp;&nbsp;&nbsp;</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (l&ouml;scht eine Datei im Verzeichnis)</p>\n<p><strong>rm -r <span style=\"color: #ff0000;\">Ordner</span>&nbsp;&nbsp;&nbsp;</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (l&ouml;scht ein Verzeichnis)</p>\n<p><strong>cp <span style=\"color: #ff0000;\">Eins Drei&nbsp;</span>&nbsp;&nbsp;</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (die Datei Eins wird kopiert und zu Drei umbenannt)</p>\n<p><strong>cp <span style=\"color: #ff0000;\">Eins Drei&nbsp;</span>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; </strong>(die Datei Eins wird in den Ordner Drei kopiert</p>\n<p><strong>cp <span style=\"color: #ff0000;\">Eins Drei/F&uuml;nf</span></strong><span style=\"color: #ff0000;\">&nbsp;</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (die Datei Eins wird in den Ordner Drei kopiert und in F&uuml;nf umbenannt</p>\n<p><strong>mv&nbsp;&nbsp;</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (verschieben)</p>\n<p><strong>cat <span style=\"color: #ff0000;\">datei</span></strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (ausgabe des Inhaltes einer Datei)</p>\n<p><strong>nano \"<span style=\"color: #ff0000;\">eine neue Datei</span>\"&nbsp;</strong> (eine neue Datei wird erstellt, deren Inhalt man direkt bearbeiten kann. Unten sind weitere Befehle mit STRG)<br /><strong>nano <span style=\"color: #ff0000;\">Datei</span>&nbsp;&nbsp;</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (ruft eine bestehende Datei auf die bear. werden kann)<br />---&gt; vi ist auch ein TextEditor, er allerdings komplizierter ist</p>\n<p><strong>su</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (Benutzer wechseln, Ende mit \"exit\") <br /><br /><strong>su root&nbsp;</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (zu Benutzer rood wechseln, Ende mit \"exit\")</p>\n<p><strong>whoami</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (gibt den aktuellen Benutzer aus)<br /><br /><strong>sudo nano <span style=\"color: #ff0000;\">datei</span>&nbsp;&nbsp;&nbsp;</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (gibt rootrechte f&uuml;r Datei, wenn root kein PW hat)<br /><br />top&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (zeigt alle 5 Sek. eine Liste aller Prozesse an - q = ende)</p>\n<p>_____________________________________________________________<br /><br /><br /><strong>espeak -v de&nbsp;&nbsp;</strong>&nbsp;&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; (auf deutsch vorlesen)</p>\n<p><strong><br />Allg. Infos:</strong><br />- mit dem Terminal bedient man \"bash\". <br />- wenn man was l&ouml;scht, wird nur der Pfad dahin gel&ouml;scht, der Inhalt wird erst dann &uuml;berschrieben, wenn der Platz gebraucht wird. <br /><br /></p>\n<h3>Links:</h3>\n<p>http://www.shellbefehle.de/befehle/</p>\n<p>http://www.pcwelt.de/ratgeber/Die_10_wichtigsten_Linux-Befehle_fuer_Einsteiger-Kommandozeile_alias_Terminal-8858519.html</p>\n<p><br /><br /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>','2015-08-23 21:46:05','2015-09-25 21:46:05',7),(138,1,'vitoop / Suche','<p lang=\"zxx\" style=\"margin-bottom: 0cm;\"><br />- Such-Ergebnis neu sortieren / + neu sortieren im Header<br />&nbsp;&nbsp; - Anzahl Tags<br />&nbsp;&nbsp; - Bewertungen<br />&nbsp;&nbsp; - Anzahl Verkn&uuml;pfungen<br />- Suchbutton &auml;ndert sich, wenn die Suche ge&auml;ndert wird, wenn der Button geklickt wurde geht er wieder zur&uuml;ck auf normal state. <br />- sp&auml;ter umkreissuche f&uuml;r Adressen (z.B. alle Adressen im Radius 50 km um Hamburg)<br />--&gt; Ausgrauen von Bereichen, wo nichts gefunden wurde<br />--&gt; Detail-Suche: Titelwort / Autor / Quelle<br /><br /><span style=\"color: #000000;\"><span style=\"text-decoration: none;\"><span style=\"font-weight: normal;\">-&nbsp;</span></span></span><strong><span style=\"color: #000000;\"><span style=\"text-decoration: none;\">Suche sortieren: </span></span></strong><span style=\"color: #000000;\"><span style=\"text-decoration: none;\"><span style=\"font-weight: normal;\">wenn man im Tabellenheader den Begriff </span></span></span><span style=\"color: #000000;\"><span style=\"text-decoration: none;\"><span style=\"font-weight: normal;\">z.B. Titel, Autor, Seitenzahl usw. </span></span></span><span style=\"color: #000000;\"><span style=\"text-decoration: none;\"><span style=\"font-weight: normal;\">anklickt wird das Suchergebnis neu sortiert.</span></span></span></p>\n<h3 lang=\"zxx\" style=\"margin-bottom: 0cm; text-decoration: none;\"><span style=\"color: #000000;\">----&gt; Detail-Suche f&uuml;r alle Bereiche</span></h3>\n<p>&nbsp;</p>\n<p><br />Hi Alexey,<br /><br />ich m&ouml;chte gerne die Suche verbessern.</p>','2015-08-23 10:07:40','2015-08-23 10:07:40',1),(139,1,'Versicherungen','<p>Abgeschlossene Versicherungen:<br />- Haftplicht<br />- ...</p>\n<p>J&auml;hrliche Besprechung mit Hr. Wiebe:<br />- was ist bei Arbeitslosgikeit?</p>','2015-08-29 19:32:23','2015-08-29 19:32:23',6),(140,1,'Rechner - Tag','<p>&nbsp;</p>\n<p>- Lesezeichen sortieren und sichern<br />- Dateien sortieren und sichern<br />- Passworte abgleichen und sichern</p>\n<p>&nbsp;</p>\n<p>---&gt; Sicherheit linux !!</p>','2015-08-30 14:48:19','2015-08-30 14:48:19',2),(141,1,'CyanogenMod und Tel.-Infos','<p>http://www.cyanogenmod-forum.de/Thread-ROM-Huawei-Ascend-Y300-CM-l%C3%A4sst-sich-nicht-installieren?page=3</p>\n<p><strong>HUAWEI Ascend Y300</strong> <br />- CyanogenMod-Version 10.2-20131227NICHTLY-u8833<br />- Android-Version: 4.3.1<br />- Prozessor: ARMv7 Processor rev 1(v7l)<br />- Kernel-Version: 3.4.0gfa26070<br /><br />-- &gt; RecoveryMode: Akku raus, einschalten - Power und Vol \"+\" halten</p>\n<p>--&gt; ROM Manager<br />--&gt; <strong>CyanogenMod-Version 11-20140530-NIGHTLY-u8833</strong> </p>\n<p><br /><strong>--&gt; die wichtigsten Apps:</strong><br />- <a href=\"http://k9mail.org/\">K-9Mail</a> statt GMail f&uuml;r Emails<br />- <a href=\"http://osmand.net/\">OSMAnd</a> statt Maps f&uuml;r die Navigation<br />- <strong>Amaze</strong> Light and smooth file manager following the Material Design guidelines<br />- Launch App Ops&nbsp; !!<br /><br /><br /><strong>--&gt; die wichtigsten Infos und Seiten:</strong> <br /><br />Gegen&uuml;ber den herstellereigenen Firmwares bietet das CyanogenMod eine Reihe neuer Funktionen. Im Hinblick auf unser Projekt ist die <strong>Rechteverwaltung</strong> von besonderer Relevanz. Durch diese n&uuml;tzliche Funktionalit&auml;t lassen sich einzelne Berechtigungen von Apps auch im Nachhinein (nach der Installation) beeinflussen. Ein zus&auml;tzlicher <a title=\"Incognito-Mode\" href=\"http://www.kuketz-blog.de/cyanogenmod-incognito-mode-schutz-gegen-schnueffel-apps/\">Incognito-Mode</a>&nbsp;kann die &raquo;<strong>Datenschn&uuml;ffellei</strong>&laquo; weiter einschr&auml;nken. http://www.kuketz-blog.de/cyanogenmod-android-ohne-google-teil3/</p>\n<p>F&uuml;r entsprechende <strong>Daten-Backups</strong> auf dem Tel. eignen sich <br />insbesondere folgende Apps:</p>\n<ul>\n<li>Helium (<a style=\"font-style: normal;\" title=\"Helium Desktop\" href=\"http://www.clockworkmod.com/carbon\">Desktop-Programm</a>&nbsp;| <a style=\"font-style: normal;\" title=\"Android-App Helium\" href=\"https://play.google.com/store/apps/details?id=com.koushikdutta.backup&amp;hl=de\">Android-App</a>)</li>\n<li><a title=\"Titanium Backup\" href=\"https://play.google.com/store/apps/details?id=com.keramidas.TitaniumBackup\">Titanium Backup</a></li>\n<li>Alternative aus dem F-Droid Store:&nbsp;<a title=\"oandbackup\" href=\"https://f-droid.org/repository/browse/?fdid=dk.jens.backup\">oandbackup</a></li>\n</ul>\n<p>Erfahrene Anwender greifen oftmals auf <a title=\"NANDroid\" href=\"http://forum.xda-developers.com/wiki/NANDroid\">NANdDroid</a>&nbsp;zur&uuml;ck. Damit l&auml;sst sich ein Image des <strong>kompletten</strong> Systems anfertigen.</p>\n<p>----------------------------------------------------------------------------------------------------<br />Wer dennoch den Installer nutzen m&ouml;chte sollte im Anschluss alle Google Apps, Bibliotheken und dergleichen entfernen. Mit Hilfe einer entsprechenden <a title=\"Remove GAPPS\" href=\"https://gist.github.com/olivier-m/6200184\">Liste mit Dateien</a> k&ouml;nnt ihr dies nachtr&auml;glich bewerkstelligen.</p>\n<p>&Uuml;ber ein spezielles <strong>Skript</strong> lassen sich die Google-Komponenten aus CyanogenMod entfernen bzw. &raquo;still legen&laquo;. Erreicht wird dies mit &raquo;<a title=\"freecyngn\" href=\"https://github.com/mar-v-in/freecyngn\">freecyngn</a>&laquo;, welches Senior XDA-Mitglied MaR-V-iN f&uuml;r die Community bereitstellt.<br /><br /></p>\n<p>Folgende Schritte m&uuml;sst ihr ausf&uuml;hren:</p>\n<ul>\n<li>&Uuml;ber <a title=\"freecyngn\" href=\"https://github.com/mar-v-in/freecyngn/releases\">GitHub</a>&nbsp;wird freecyngn zun&auml;chst heruntergeladen. Achtet darauf, dass ihr auch die flashbare Version (freecyngn-flashable.zip) erwischt.</li>\n<li>Kopiert das Zip-File anschlie&szlig;end auf den internen Speicher oder eure SD-Karte des Androiden.</li>\n<li>Haltet den Powerbutton nun solange gedr&uuml;ckt, bis ein Fenster erscheint, in dem ihr den Punkt &raquo;Neu starten&laquo; w&auml;hlen k&ouml;nnt. In einem weiteren Fenster habt ihr anschlie&szlig;end die Wahl, in den &raquo;Recovery&laquo; Modus zu booten.</li>\n<li>&Uuml;ber den Men&uuml;punkt &raquo;install zip&laquo; w&auml;hlt ihr anschlie&szlig;end &raquo;choose zip from /sdcard&laquo;. Navigiert zum Ordner in dem ihr die &raquo;freecyngn-flashable.zip&laquo; Datei abgelegt habt und best&auml;tigt die Installation.</li>\n<li>Der Vorgang nimmt einige Minuten&nbsp;in Anspruch.</li>\n<li>&Uuml;ber &raquo;reboot system now&ldquo; wird anschlie&szlig;end ein Neustart des Ger&auml;ts eingeleitet.</li>\n</ul>\n<p>_____________________________________________________________<br /><br />&Uuml;ber einen mobilen Browser l&auml;sst sich die Installation der F-Droid App rasch erledigen. &Ouml;ffnet dazu den Link (<a title=\"F-Droid Download\" href=\"https://f-droid.org/FDroid.apk\">https://f-droid.org/FDroid.apk</a>). Alternativ k&ouml;nnt ihr das Android APK-File auch erst auf den Rechner laden und mittels USB auf das Endger&auml;t &uuml;bertragen. In jedem Fall m&uuml;sst ihr f&uuml;r diese Installation die Funktion &raquo;<strong>Installation von Apps aus unbekannten Quellen zulassen</strong>&laquo; aktivieren. Diese findet ihr unter &raquo;Einstellungen -&gt; Sicherheit -&gt; Unbekannte Herkunft&laquo;. Nach Abschluss der Installation solltet ihr das gesetzte H&auml;kchen in jedem Fall wieder entfernen.</p>\n<p><br /><br /><br /><br /><br /><br /><br /><br /><br /><br /></p>','2015-09-05 15:54:08','2016-02-20 15:54:08',8),(142,53,'Test - Test - Test','<p>&nbsp;</p>\n<p>&nbsp;&nbsp;&nbsp; Test</p>','2016-02-27 22:36:18','2016-02-27 22:36:18',0);
