INSERT INTO `vitoop_user_invitation` VALUES (15,1,'Einladung zum Informationsportal vitoop','Hallo Bettina,\r\n\r\n.. viel Spaß beim Stöbern und Probieren, wenn Du Fragen oder Anmerkungen hast schreib mir bitte unter david@vitoop.org. \r\n\r\nDu kannst Dich registrieren unter: {LINK}\r\n(Beachte bitte, dass dieser Link bis zum {UNTIL} gültig ist.)\r\n\r\nLiebe Grüße\r\n\r\nDavid','bettina.warmbold@web.de','d2ee41d9b91cc9477099c28ecb831858','2015-05-26 21:55:57'),(16,1,'Einladung zum Informationsportal vitoop','Hallo Elizabeth,\r\n\r\nwir hatten schon lange keinen Kontakt mehr und ich hoffe es geht Dir gut!? .. um die Welt ein kleines bisschen besser zu machen :) hab ich mit großem Aufwand eine Online-Datenbank entwickeln lassen um gute Informationen zu sortieren und miteinander zu verbinden. Im Moment ist sie noch in einer beta-Phase, läuft aber schon rund - und suche Text-Benutzer, die schonmal ein bisschen nach Infos stöbern und rumprobieren. Wenn Du Interesse hast oder jemand kennst, der sich dafür interessiert würde mich das sehr freuen. \r\n\r\nWenn Du willst, kannst Dich registrieren unter: {LINK}\r\n(Beachte bitte, dass dieser Link bis zum {UNTIL} gültig ist.)\r\n\r\nLiebe Grüße \r\n\r\nDavid','elizabeth.jordana@googlemail.com','a4f4572013e4f0740cd34b331f0ae95e','2015-05-26 22:04:06'),(17,1,'Einladung zum Informationsportal vitoop','Hallo Anne,\r\n\r\ndie Datenbank ist jetzt endlich soweit, dass ich sie mal herzeigen möchte. Im Moment bin ich verzweifelt auf der Suche nach vertrauenswürdigen Test-Benutzern und hatte gedacht, dass Andi vielleicht Interesse hätte das mal auszuprobieren. - > willst Du ihm die Mail bitte weiterleiten? Wenn Du willst schicke ich Dir auch einen Link zu ..\r\n\r\nIch hoffe es geht euch gut und dass ihr ein schönes Pfingsten habt :)\r\n\r\nRegistrieren unter: {LINK}\r\n(Beachte bitte, dass dieser Link bis zum {UNTIL} gültig ist.)\r\n\r\nLiebe Grüße \r\n\r\nDavid','ak.bentele@me.com','d4d45bc276b05fb3a8fe7bfc8afeedfb','2015-05-27 11:55:27'),(18,1,'Einladung zum Informationsportal vitoop','Hallo Jana, \r\n\r\nihr habt eine sehr sympathische Internetseite, ich habe gerade ein paar Sachen gelesen und hoffe, dass das gut anläuft! \r\n\r\nDu kannst Dich registrieren unter: {LINK}\r\n(Beachte bitte, dass dieser Link bis zum {UNTIL} gültig ist.)\r\n\r\nLG\r\n\r\nDavid','jana.scharf@vitamen.de','55b1daaf79c12fc9a42acce0dafb9b52','2015-05-27 17:35:45'),(21,1,'Einladung zum Informationsportal vitoop','Hallo Jörg,\r\n\r\ndanke für die Unterlagen. \r\n\r\nDie Dauer der Registrierungsfrist kann ich aktuell leider nicht beeinflussen, aber hier ist nochmal ein neuer Link. Bei Bedarf würde ich z.B. vor dem Wochenende nochmal einen verschicken. \r\n\r\nDu kannst Dich registrieren unter: {LINK}\r\n(Beachte bitte, dass dieser Link bis zum {UNTIL} gültig ist.)\r\n\r\nLG\r\n\r\nDavid','contact@joerg-rainals.de','4c565bcba2ac47c61e37beaa0e9dc87f','2015-06-04 17:55:56');
